INSERT INTO `aams_project` VALUES ('01beb306ca3e4584bcd0a64b8656fcd0','2','20180730393','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司管控整改核查事项：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2017年问题整改情况：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;投资管控： 1.未执行《项目库及投后管理暂行办法》中投资项目于不同阶段的及时跟进。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2.投资信息提供的及时性、准确性不足。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','公司督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;7月27日完成整改并迎接集团管控检查。&lt;/span&gt;&lt;/p&gt;','2018-07-27','已完成',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-30 10:01:44','1','2018-09-20 15:41:43',NULL,'0');
INSERT INTO `aams_project` VALUES ('025236dfaa1b425b908f571c89c6540d','3','20171102119','2','&lt;p&gt;\r\n	已完工道路代为养护管理方案&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	11月1日与市北区城管局、道路养护单位协商一致&lt;/p&gt;','2017-11-01','10月28日滨海办主持召开移交工作协调会\r\n10月30日市北城管提出养护费用。\r\n11月1日召开专题会，与市北城管、养护单位就三方协议、养护费用、养护标准，城管局来函内容等进行了充分沟通，向城管局领导汇报后发公函明确相关内容。',NULL,NULL,'','2017-11-02','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 08:40:35','2','2017-11-02 11:37:04',NULL,'0');
