INSERT INTO `aams_project` VALUES ('040fd0226a834b948f3d80b50a823efe','3','20171218247','2','&lt;p&gt;\r\n	按照10月11日集团下发的《关于做好2018年度《中国安全生产报》订阅工作的通知》的通知要求，12月20日前提报附件二（订阅《安报》统计反馈表及发票复印件）至集团安全部，汇总后报市安监局。&lt;/p&gt;','集团安全部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	附近邮局订阅《中国安全生产报》&lt;/p&gt;\r\n&lt;p&gt;\r\n	拿取发票，上报订报反馈表，完成订阅任务&lt;/p&gt;','2017-12-20','进行中',NULL,NULL,'','2018-01-26','|/aams/userfiles/f6161efe2459473d87c59b7100087481/files/project/aamsProject/2017/12/%E5%85%B3%E4%BA%8E%E5%81%9A%E5%A5%BD2018%E5%B9%B4%E5%BA%A6%E3%80%8A%E4%B8%AD%E5%9B%BD%E5%AE%89%E5%85%A8%E7%94%9F%E4%BA%A7%E6%8A%A5%E3%80%8B%E8%AE%A2%E9%98%85%E5%B7%A5%E4%BD%9C%E7%9A%84%E9%80%9A%E7%9F%A5.doc',NULL,'4','f6161efe2459473d87c59b7100087481','2017-12-18 11:09:57','2','2018-01-26 16:08:08',NULL,'0');
INSERT INTO `aams_project` VALUES ('047456f9e8eb4d37a63e70eab02ef0d1','2','20180307331','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;根据集团组织的&amp;ldquo;信访百日攻坚&amp;rdquo;活动，共分4个阶段，按阶段开展活动并汇总资料，上报集团&lt;/span&gt;&lt;/p&gt;','公司督办','66ad875799dd4edeb2f648eb9486e9e2','&lt;p class=&quot;MsoNormal&quot; style=&quot;margin: 5pt 0pt; line-height: 32pt; text-indent: 31.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;、排查摸底阶段&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;2月10日－20日，对信访案件和不稳定因素进行全面排查，2月20日前，上报第一阶段汇总材料。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt; font-family: &amp;quot;Helvetica Neue&amp;quot;; font-size: 10.5pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin: 5pt 0pt; line-height: 32pt; text-indent: 31.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;2、准备阶段&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;。从2月21日到2月28日，于2月28日前，上报集团办公室工作方案、活动期间领导带班值班名单。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt; font-family: &amp;quot;Helvetica Neue&amp;quot;; font-size: 10.5pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin: 5pt 0pt; line-height: 32pt; text-indent: 31.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;3、集中攻坚阶段&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;。从3月2日到5月10日，对排查出的各类信访问题，逐个研究落实工作措施。于5月10日前形成材料。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin: 5pt 0pt; line-height: 32pt; text-indent: 31.5pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;4、检查验收阶段&lt;/span&gt;&lt;span style=&quot;letter-spacing: 0pt;&quot;&gt;。从5月11日至5月20日，对百日攻坚活动认真组织自查，做好总结和收尾工作。迎接集团信访办对各单位的百日攻坚活动进行的检查验收，形成材料，进行汇总和反馈，于5月18日下班前报集团办公室。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-05-31','正常推进',NULL,NULL,'','2018-06-07','|/aams/userfiles/2/files/project/aamsProject/2018/03/%E4%BF%A1%E8%AE%BF.zip',NULL,'4','2','2018-03-07 15:59:21','1','2018-06-07 16:11:00',NULL,'0');
INSERT INTO `aams_project` VALUES ('05d5a38b3ebe462e978e65cf6779e022','2','20181229430','2','&lt;p&gt;\r\n	参加集团十周年庆典活动&lt;/p&gt;','集团工会','7a04dbedd53b485c96e38d283798ddc2','&lt;p&gt;\r\n	1.摄影、书画大赛&lt;/p&gt;\r\n&lt;p&gt;\r\n	2.篮球比赛&lt;/p&gt;','2018-12-31','已办结',NULL,NULL,'',NULL,'',NULL,'3','1','2018-12-29 15:35:41','1','2018-12-29 15:35:41',NULL,'0');
INSERT INTO `aams_project` VALUES ('066783bf94cd4f2480b28a45b795857c','2','20180815406','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司&amp;ldquo;百日攻坚&amp;rdquo;专项活动方案：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;即墨宋化泉水库项目。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','公司督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;1.7&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前完成即墨区政府、青岛城投、国投中成集团三方战略合作协议初稿编制，与国投青岛团队对接。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;2.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前，督促国投青岛团队尽快将协议提报北京总部相关部门内部立项，并及时反馈。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;3.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;11-20&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日，根据国投反馈的修改意见，双方进一步完善修改协议。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;4.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前双方将协议分别提报集团主要领导审批。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;5.9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前，双方集团领导审核同意后，推进国投、城投双方领导座谈、交流。签署双方合作备忘录。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;6.9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前，与即墨区政府有关部门、单位对接，并根据政府要求完善、修改协议内容。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;7.10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;之前协调区政府有关部门工作，尽快完成协议审批。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;8.10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前，协议通过区政府审批，确定签约具体时间及地点。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt; mso-line-height-rule: exactly;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;9.10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前，举行签约仪式。&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-29','',NULL,'4','1','2018-08-15 14:33:49','1','2018-12-29 11:11:10',NULL,'0');
INSERT INTO `aams_project` VALUES ('07607e8ea0ea404093694f7c84a0fe63','3','20171102126','2','&lt;p&gt;\r\n	剩余道路全部工程量的确认（包含已完成及未完成部分）&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	10月20日完成剩余道路的工程量确认&lt;/p&gt;','2017-10-20','完成工程量确认并经各方签字、盖章',NULL,NULL,'','2017-11-14','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 09:05:11','1','2017-11-14 18:14:09',NULL,'0');
INSERT INTO `aams_project` VALUES ('07d4e7400bad4f3e8c1f198e34d6fa5c','2','20180927417','2','&lt;p&gt;\r\n	欢乐滨海城剩余道路用地手续办理&lt;/p&gt;','公司办公会','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	1.10月上旬完成欢乐滨海城用地预审的延期工作，并争取协调市北区城建局向市北区规划局提出纵B5等3条道路的建设项目选址意见申请&lt;/p&gt;\r\n&lt;p&gt;\r\n	2.11月中旬，争取取得纵B6等7条路的建设项目选址意见书和建设用地规划许可证&lt;/p&gt;\r\n&lt;p&gt;\r\n	3.在胜通公司同意的情况下，与国土局对接，按有关规定办理7条道路用地的划拨手续，年底前争取完成相关手续办理工作。&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-29','',NULL,'4','f58e81cf534f498d92119f82ce355540','2018-09-27 15:05:49','1','2018-12-29 11:14:27',NULL,'0');
INSERT INTO `aams_project` VALUES ('0843e013ba91402d9f844eb918fa9da9','2','20180730396','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2017年置地公司管控整改核查事项：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;财务和预算管控：1、需于6月1日前完成财务审批制度备案，并启用新OA审批流程。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2.委派财务负责人责权不明晰。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;3.未根据实际情况制定相应的财务审批制度。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;4.预算档案管理工作尚待加强。&lt;/span&gt;&lt;/p&gt;','公司督办','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;7月27日完成整改并迎接集团管控检查。&lt;/span&gt;&lt;/p&gt;','2018-07-27','已完成',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-30 10:18:20','1','2018-09-20 15:42:18',NULL,'0');
