INSERT INTO `aams_project` VALUES ('0b500dac1c4249bab2efa5a38f8b9034','2','20180124273','2','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;margin-left: 0cm; text-indent: 0cm;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;路灯工程：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;、工程现状：路灯一期工程已经移交。二期已通过集团招标会。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14.0pt;font-family:宋体;\r\nmso-bidi-font-family:仿宋_GB2312&quot;&gt;计划：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;日完成&lt;span lang=&quot;EN-US&quot;&gt;83&lt;/span&gt;盏灯移交。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;日完成路灯招标。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;日完成路等施工。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;6&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;日，完成路灯工程的移交。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:\r\n宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;6&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;日，完成剩余路灯工程的结算审核。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-06-30','正常推进',NULL,NULL,'',NULL,'|/aams/userfiles/2/files/project/aamsProject/2018/01/%E5%B7%A5%E7%A8%8B%E9%83%A82018%E5%B9%B4%E8%BF%9B%E5%BA%A6%E8%AE%A1%E5%88%92%E6%B1%87%E6%80%BB%E5%B7%A5%E4%BD%9C%E8%A1%A8.xls|/aams/userfiles/2/files/project/aamsProject/2018/01/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E5%B8%82%E6%94%BF%E9%85%8D%E5%A5%972018%E5%B9%B4%E5%B7%A5%E7%A8%8B%E8%AE%A1%E5%88%92.doc',NULL,'3','2','2018-01-24 12:36:56','2','2018-01-26 13:57:51',NULL,'1');
