INSERT INTO `aams_project` VALUES ('0e81fcc9bd4f44438b7778da62eb04ab','3','20171102132','2','&lt;p&gt;\r\n	完成&amp;ldquo;关于欢乐滨海城路灯及交通设施等招标工作的请示&amp;ldquo;&lt;/p&gt;\r\n&lt;p align=&quot;center&quot; class=&quot;MsoNormal&quot; style=&quot;margin-bottom:6.0pt;mso-para-margin-bottom:\r\n.5gd;text-align:center&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:22.0pt&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	10月31日报告编制并报中管中心&lt;/p&gt;','2017-10-31','完成报告编制并报工管中心。\r\n工管中心建议向集团分管领导汇报后再进行下一步工作。',NULL,NULL,'','2017-11-23','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 09:13:16','2','2017-11-23 13:52:04',NULL,'0');
