INSERT INTO `aams_project` VALUES ('0f9977f538ea44768148dac5d8cca5db','2','20180104257','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2017年集团安全大检查及集团考核部门单位安全生产目标责任制考核&lt;/span&gt;&lt;/p&gt;','集团安全部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;1.动员部署阶段：2017年12月4号-12月7日，&lt;span style=&quot;text-indent: 32pt;&quot;&gt;按照&amp;ldquo;分级管理、各负其责&amp;rdquo;的原则，置地公司组织召开岁末年初安全生产大检查动员会。制定公司隐患自查自改实施方案，并将安全大检查实施方案部署到位，充分调动全体职工参与岗位隐患自查的积极性。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;2.重点检查和各单位自查自改阶段：2017年12月8日-20日，针对滨海城现有项目，制定安全检查实施方案，一自查自该方式汇总问题和整改措施，上报集团安全部备查&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;3.全面检查和元旦节假日检查阶段：2017年12月21日-2018年1月3日，根据集团你要求和安全生产标准化规范，建立健全安全生产和消防安全责任制体系，完善所有相关安全制度，开展安全培训，安排公司及工地元旦值班表。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family: 仿宋_gb2312;&quot;&gt;4.整改落实&amp;ldquo;回头看&amp;rdquo;和培训演练阶段：2018年1月4日-2018年1月31日，列出此次安全大检查排查发现的隐患，制定整改方案，做到治理责任、措施、资金、期限、应急预案&amp;ldquo;五落实&amp;rdquo;。结合冬春季节气候特点，掌握取暖和安全用电情况，严防安全事故发生。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;5.春节和两会再整治再行动阶段（2018年2&lt;/span&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;text-indent: 32pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;日&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;text-indent: 32pt;&quot;&gt;-2&lt;/span&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;22日）。春节即将来临，两会即将召开。根据时间节点安排，在前一阶段大检查、大整改、回头看的基础上，继续做安全维护，保持岁末年初安全生产大检查的高压态势，确保春节期间平安祥和，两会期间稳定有序，切实做到为生产经营保驾护航，为社会和谐稳定贡献力量。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;&lt;span style=&quot;text-indent: 32pt;&quot;&gt;6.巩固提高和总结经验阶段（&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;23&lt;/span&gt;日&lt;span lang=&quot;EN-US&quot;&gt;-2&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;28&lt;/span&gt;日）。置地公司对大检查活动中发现的问题和隐患，在整改到位的基础上，继续加大监控监管力度，确保工作成效得到巩固和提高。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;7.报送大检查各个阶段推进情况和工作情况一览表。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;span style=&quot;font-family:仿宋_gb2312;&quot;&gt;8.2月27日前报送大检查工作总结。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-02-27','正常推进',NULL,NULL,'','2018-03-01','|/aams/userfiles/f9ba8b27243845a8a5d28b97e02ce116/files/project/aamsProject/2018/01/%E9%9D%92%E5%9F%8E%E6%8A%95%E5%AE%89%E5%AD%97%E3%80%942017%E3%80%9513%E5%8F%B7.doc|/aams/userfiles/2/files/project/aamsProject/2018/01/%E7%BD%AE%E5%9C%B0%E5%85%AC%E5%8F%B82017%E5%B9%B4%E5%BA%A6%E5%AE%89%E5%85%A8%E7%94%9F%E4%BA%A7%E8%87%AA%E6%9F%A5%E6%80%BB%E7%BB%93%E6%B1%87%E6%8A%A5.docx',NULL,'4','f9ba8b27243845a8a5d28b97e02ce116','2018-01-04 14:09:00','2','2018-03-01 10:14:33',NULL,'0');
