INSERT INTO `aams_project` VALUES ('0fbfc9dd8a1747ceb6a5025117bc51fb','3','2017110163','2','&lt;p&gt;\r\n	&lt;font color=&quot;#444444&quot; face=&quot;Helvetica, Georgia, Arial, sans-serif, 宋体&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;原则上每月25日之前完成集团督办项目整理汇报，督促责任人完成督办项目。&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;','集团督办','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	每月根据集团通知要求&lt;span style=&quot;color: rgb(68, 68, 68); font-family: Helvetica, Georgia, Arial, sans-serif, 宋体; font-size: 12px;&quot;&gt;完成集团督办项目进展情况整理汇报，督促相关责任人完成督办项目。&lt;/span&gt;&lt;/p&gt;','2017-12-31','10月份集团督办项目进展情况汇报已经完成，报路灯工程移交项目办结已完成（附移交书），经请示国利总和张义清经理分别上报道路完善项目施工计划、工程造价完成情况汇报和剩余土地收储和审计整改相关情况。未接到集团督办通知单无紧急催办项目。',NULL,NULL,'每月均需及时上报督办进展情况','2017-12-28','',NULL,'4','28d2adbfc20a40a79fd7f8c8393820df','2017-11-01 15:15:42','2','2017-12-28 11:46:36',NULL,'0');
