INSERT INTO `aams_project` VALUES ('11f5179d50ca485881b1eea72d815e90','1','2017110136','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;&lt;span style=&quot;font-family:黑体;&quot;&gt;前期手续不完善项目补办（巡视组整改提出）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','第11次党委会\r\n20160513','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1、8条道路工作计划：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.1、10月15日完成施工图纸; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.2、10月25日完成工程造价; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.3、11月10日完成工程造价的专家论证; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.4、11月30日完成工程造价的审批; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.5、12月25日签订施工合同; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.6、2018年3月30日道路完善;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.7、 2018年5月30日完成具备土地手续的道路移交。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2、欢乐滨海城购物小岛内河：2017年年底彻底完成项目竣工验收手续。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;3、红岛绿洲湿地项目已移交高投集团（办结）&lt;/span&gt;&lt;/p&gt;','2018-03-01','1.欢乐滨海城购物小岛内河工程，已完成竣工验收手续   2.剩余八条道路完善工程实施路径九月份通过集团董事扩大会，根据工作计划，已完成施工图纸，本周出具工程造价文件，2018年二季度完成施工任务',NULL,NULL,',建议对督办项目时限进行调整，2018年上半年完成施工任务，三季度完成项目移交工作,按照2017年6月份土地收储办理完成考虑，2017年9月完成招标，年底完工并办理竣工手续',NULL,'',NULL,'3','2','2017-11-01 10:33:55','1','2017-11-10 18:12:35',NULL,'1');
