INSERT INTO `aams_project` VALUES ('15f27632b2bf4778be178b2b3657c611','3','20180510355','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 22px;&quot;&gt;去集团参加安全生产培训。&lt;/span&gt;&lt;/p&gt;','集团安全和工程管理部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 22px;&quot;&gt;2018年5月9日下午14：00-17：00参加集团安全生产培训并参加考试。&lt;/span&gt;&lt;/p&gt;','2018-05-09','已完成',NULL,NULL,'','2018-06-07','',NULL,'4','f9ba8b27243845a8a5d28b97e02ce116','2018-05-10 08:43:16','1','2018-06-07 16:39:26',NULL,'0');
INSERT INTO `aams_project` VALUES ('168a19bce1d44a03b5ddcdffc8241df5','1','20181229426','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;未储备545亩土地及9宗地出让事宜&lt;/span&gt;&lt;/p&gt;','集团办公室','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;截至2018年12月初，胜利股份仍在落实审计提出多支付补偿款的还款来源和途径，在其完全落实资金来源和途径后计划：（1）15日内完成土地补偿协议的签订；（2）在协议签订后，1个月内取得规划设计条件；（3）在取得规划设计条件后，4个月内完成土地招拍挂工作；（4）在招拍挂工作完成后，2个月内胜通所有股东退还多补偿资金到账城投集团；（5）在退款完成后，2个月内，对城投集团在土地一级开发整理的投入和城投集团在胜通公司的股东权益进行全面梳理，将欢乐滨海城项目资金整体平衡情况形成专题报告报城投集团审议通过后，以城投集团名义向市政府行文报告。&lt;/span&gt;&lt;/p&gt;','2019-09-30','胜利股份仍在落实审计提出多支付补偿款来源和途径。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-12-29 09:06:39','1','2018-12-29 09:06:39',NULL,'0');
INSERT INTO `aams_project` VALUES ('17a5f94ce8be441d89007f330fc1ed01','3','20171103143','2','&lt;p&gt;\r\n	按资金部要求汇总报送置地、湿地、胜通公司10月份月末头寸表&lt;/p&gt;','集团资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	按要求时间及时汇总报送。&lt;/p&gt;','2017-12-31','按时间要求进行中',NULL,NULL,'','2017-12-15','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2017-11-03 16:16:53','2','2017-12-15 11:53:00',NULL,'0');
