INSERT INTO `aams_project` VALUES ('1ecfcb9c58544286b7f1d9ebc4dd5ef3','1','20180613372','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;藏马山项目。&lt;/span&gt;&lt;/p&gt;','集团督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;鉴于藏马山项目目前切入时机不成熟，该项目保持继续与藏马山旅游度假区领导小组跟进的同时，拟先行洽谈西海岸新区其他项目，再择机介入。具体安排如下：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;1月继续与藏马山旅游度假区领导小组办公室对接，对该项目进行详细调查，重点寻找切合投资时机的项目，每周1一次。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;2月按照摸底情况，对接区域内具体项目的投资合作方，对项目的情况进行尽调，完成项目资料的整理。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;3月研究项目投资合作模式，寻找投资路径，并进行论证，置地公司内部形成意见。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;4月按照公司确定的投资模式与项目方进行谈判、论证，确定项目能否合作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;5月根据上述谈判的情况，具体安排上报集团内部上会审批程序。&lt;/span&gt;&lt;/p&gt;','2018-12-31','至2018年5月期间，与西海岸农新区管委会进行了多次对接， 当地政府对藏马山的前期规划等至今尚未落实。项目原计划采用PPP模式，但是，近期财政部及发改委多次发文，进一步严格审批PPP项目入库。特别是山东省相关衍生政策对PPP模式严格控制，造成现阶段PPP模式推进困难。\r\n2018年初，当地管委会进行了机构调整，主要领导调离，新领导班子对于藏马山整体发展思路作出调整，与我们预期不相吻合。鉴于以上原因，将藏马山作为整体开发的思路受限。\r\n今年1月份起，置地公司开始跟踪藏马山区域内丰泽山庄项目，拟对丰泽山庄周边的土地进行整理，引进康养项目，2月份已收集项目的相关资料，计划以与蓝卡健康成立合资公司的方式，进行康养项目的合作，但由于原地主预期价格过高，投资风险较大，而中止谈判。\r\n目前基于以上原因，认为藏马山目前不具备进入投资开发条件。后续，置地将继续积极跟踪规划编制情况及区域内项目信息，待合适时机，再行进入并列出相应的工作计划。\r\n建议集团督办调度会后办理跟踪。',NULL,NULL,'','2018-10-24','',NULL,'4','1','2018-06-13 15:29:00','1','2018-10-24 17:29:23',NULL,'0');
