INSERT INTO `aams_project` VALUES ('2cf1c2bc6b764eb386ab1596a0a38599','3','20171102120','2','&lt;p&gt;\r\n	绿化移交方案与市北城管局、养护单位协调一致&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	112月完成绿化移交方案的协商&lt;/p&gt;','2017-10-02','10月28日滨海办主持召开移交工作协调会\r\n10月30日与养护单位对移交方案进行深入沟通，对相关费用的处理方式进行了明确。\r\n11月1日市北城管局同意进行已清点苗木的分片移交',NULL,NULL,'','2017-11-14','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 08:53:12','1','2017-11-14 18:14:23',NULL,'0');
INSERT INTO `aams_project` VALUES ('2d42763b058247298962ab0a593e6867','2','20180124282','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:黑体;\r\nmso-hansi-font-family:黑体;mso-bidi-font-family:仿宋_GB2312;mso-ansi-language:EN-US;\r\nmso-fareast-language:ZH-CN;mso-bidi-language:AR-SA;mso-bidi-font-weight:bold&quot;&gt;西海岸新区项目&lt;/span&gt;&lt;/p&gt;','集团督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;\r\nfont-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:\r\n仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;鉴于藏马山项目目前切入时机不成熟，该项目保持继续与藏马山旅游度假区领导小组跟进的同时，拟先行洽谈西海岸新区其他项目，再择机介入。具体安排如下：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月份，继续与藏马山旅游度假区领导小组办公室对接，对该项目进行详细调查，重点寻找切合投资时机的项目，每周&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;一次。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月份，按照摸底情况，对接区域内具体项目的投资合作方，对项目的情况进行尽调，完成项目资料的整理。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;年&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;月份，研究项目投资合作模式，寻找投资路径，并进行论证，置地公司内部形成意见。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;年&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;月份，按照公司确定的投资模式与项目方进行谈判、论证，确定项目能否合作？&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;年&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;月份，根据上述谈判的情况，具体安排上报集团内部上会审批程序。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','2018-05-31','正常推进',NULL,NULL,'',NULL,'|/aams/userfiles/2/files/project/aamsProject/2018/01/%E6%8A%95%E8%B5%84%E9%83%A82018%E5%B9%B4%E5%B7%A5%E4%BD%9C%E5%AE%89%E6%8E%92.docx',NULL,'3','2','2018-01-24 12:58:20','2','2018-01-24 12:58:20',NULL,'1');
INSERT INTO `aams_project` VALUES ('2d90a7c120d846129be677feaf51afe6','3','20171101104','2','&lt;p&gt;\r\n	湿地公园景观设计单位索赔事项，根据集团成立工作组的意见，整理集团党委会上会材料。&lt;/p&gt;','集团湿地公园设计工作推进小组交办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	本周五将材料整理完毕，先行向工作组汇报，然后由工作组领导向分管领导后进行修改。&lt;/p&gt;','2017-11-03','正在收集相关资料。',NULL,NULL,'','2017-11-10','',NULL,'4','48433cda981346578a4515c15d5d5800','2017-11-01 17:20:59','2','2017-11-10 14:00:18',NULL,'0');
INSERT INTO `aams_project` VALUES ('2e495af988444e1e9ea35204a8885a13','2','20180815407','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司&amp;ldquo;百日攻坚&amp;rdquo;专项活动方案：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;欢乐滨海城绿化补苗工程。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','公司督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;1.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前组织专题会议，确定合同模式；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;2.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;23&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前由接收单位起草分包协议书；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;3.10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前完成地块边角绿化变更；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quo