INSERT INTO `aams_project` VALUES ('308907c9a31844fcac7f6134bac8cafa','3','2017110186','2','&lt;p&gt;\r\n	对市热线办关于路灯工程&amp;ldquo;一把手&amp;rdquo;通报问题反馈，并向集团办公室汇报关于欢乐滨海城路灯工程工作计划。&lt;/p&gt;','集团交办事项','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	对市热线办关于路灯工程&amp;ldquo;一把手&amp;rdquo;通报问题反馈，并向集团办公室汇报关于欢乐滨海城路灯工程工作计划。&lt;/p&gt;','2017-10-31','已办结',NULL,NULL,'','2017-11-14','',NULL,'4','28d2adbfc20a40a79fd7f8c8393820df','2017-11-01 16:24:01','1','2017-11-14 18:15:29',NULL,'0');
INSERT INTO `aams_project` VALUES ('30ca303cf8e743f3a0c77a8ecab8596b','1','20180613369','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;span style=&quot;background-color:#f0fff0;&quot;&gt;欢乐滨海城审计整改工作&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;8月底前完成土地补偿协议的签订。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;9月底前完成土地收储、挂牌条件设定等工作。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;11月底前完成土地招拍挂工作并办理土地出让金返还相关事宜，同时要求在11月底前胜通所有股东退还款到账城投集团。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;12月底前根据最终拍卖情况，对城投集团在土地一级开发整理的投入和城投集团在胜通公司的股东权益进行全面梳理，将欢乐滨海城项目资金整体平衡情况形成专题报告报城投集团审议通过后，以城投集团名义向市政府行文报告。&lt;/span&gt;&lt;/p&gt;','2018-12-31','胜利股份仍在落实审计提出多支付补偿款的还款来源和途径。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-06-13 15:21:45','1','2018-12-29 08:57:47',NULL,'0');
