INSERT INTO `aams_project` VALUES ('5248bfa507514dbfa55a3ab336824c41','1','20171228255','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;推进即墨宋化泉水库项目。&lt;/span&gt;&lt;/p&gt;','重点项目专题会\r\n（20171117）','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse;&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664;&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;546&quot; style=&quot;height: 409.5pt; mso-height-source: userset;&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;546&quot; style=&quot;border-width: 0.5pt medium; border-style: solid none; border-color: windowtext; width: 695pt; height: 409.5pt; background-color: transparent;&quot; width=&quot;927&quot;&gt;\r\n				&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;1月份进行项目区域内村庄、企业、土地资源等尽调工作。&lt;br /&gt;\r\n				2月进行项目区域内村庄、企业、土地资源等尽调工作，选择PPP项目咨询机构、策划单位参与项目调研、策划方案编制工作。督促中规院深圳分院完成项目概念性规划方案初稿编制。&lt;br /&gt;\r\n				3月督促中规院深圳分院概念性规划方案编制，同步进行控详规的编制、论证工作。&lt;br /&gt;\r\n				4月督促中规院深圳分院完成概念性规划方案编制并经即墨区政府批复，在概规批复后深入进行控详规的编制、论证工作。&lt;br /&gt;\r\n				5月控详规的编制、论证工作，同步进行可行性研究报告编制。&lt;br /&gt;\r\n				6月可行性研究报告编制、评估、论证工作，PPP项目实施方案编制。&lt;br /&gt;\r\n				7月协助区政府开展物有所值评价、财政承受能力评价工作。&lt;br /&gt;\r\n				8月协助即墨区政府推进PPP项目入库工作。&lt;br /&gt;\r\n				9月由即墨区政府启动项目招标程序，进行投标工作，集团内部项目上会审批流程。&lt;br /&gt;\r\n				10月与葛洲坝组成联合体进行项目投标工作。如项目顺利中标，根据实施方案的步骤编制项目整体的投资、建设计划。&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;','2018-09-30','&quot;1.一月份已完成汇总区域内的村庄资源调查情况\r\n2.与葛洲坝集团一起商讨项目的合作实施方案，正在与国赢大富、浙江中网银新等中介单位洽谈合作方式，以备为下一步项目实施方案中的运营环节打好基础。\r\n3.三月，由于北安街道迟迟未与中规院签订委托合同，概规编制推进缓慢，现加紧催促北安街道尽快完成设计合同的签订。 &quot;',NULL,NULL,'10月底',NULL,'',NULL,'3','2','2017-12-28 09:14:50','1','2018-05-31 13:17:34',NULL,'1');
