INSERT INTO `aams_project` VALUES ('5761cab66cfe440b9ba5cbe494d72479','2','20180815408','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司&amp;ldquo;百日攻坚&amp;rdquo;专项活动方案：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;湿地公园示范园区遗留问题工作计划。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','公司督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;1.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日之前由相关负责人和当事人对项目概况及决策背景进行写实性描述并进行签字确认&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;;l&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;2.9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前完成现存的湿地公园示范园区施工图纸及项目相关资料的收集、整理工作；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;3.10&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前完成示范园区遗留问题解决方案，报集团决策。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-10-3