INSERT INTO `aams_project` VALUES ('5951767455464ba191ed0fe3479e1ecb','3','20171120196','2','&lt;p&gt;\r\n	建立项目电子信息库、整理项目资料、搜集最新与项目有关的资料进行整理收录电子档案库。&lt;/p&gt;','投资部及网络信息','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	建立完善的项目库及与项目有关的电子信息库&lt;/p&gt;','2017-11-30','与项目有关的项目库已基本完成，与项目有关的电子信息库继续完善整理中',NULL,NULL,'',NULL,'',NULL,'5','f97df342706947d189491bd395b7a6c7','2017-11-20 10:44:33','2','2017-11-23 15:52:38',NULL,'0');
INSERT INTO `aams_project` VALUES ('5bf4106f198d41a4b5d031d14802c3f0','1','20171114189','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px&quot;&gt;绿洲湿地公司董监事变更。&lt;/span&gt;&lt;/p&gt;','工作目标','5322e81fcd36411a8bb8d6ef43f109b8','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse&quot; width=&quot;927&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;241&quot; style=&quot;height: 180.75pt; mso-height-source: userset&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;241&quot; style=&quot;border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: transparent; width: 695pt; height: 180.75pt; border-top: windowtext 0.5pt solid; border-right: windowtext&quot; width=&quot;927&quot;&gt;\r\n				&lt;span style=&quot;font-size: 24px&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;待集团和高新区管委明确红岛绿洲湿地项目资产处置方案后一个月内完成绿洲湿地公司的董监事变更事宜。（2017年10月23日调整）&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;241&quot; style=&quot;height: 180.75pt; mso-height-source: userset&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;241&quot; style=&quot;border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: transparent; width: 695pt; height: 180.75pt; border-top: windowtext 0.5pt solid; border-right: windowtext&quot; width=&quot;927&quot;&gt;\r\n				&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;','2018-12-31','&quot;\r\n红岛绿洲湿地项目现场管理权已于2017年初移交高投集团，但是资产处置方案暂未明确。\r\n明确红岛绿洲湿地项目资产处置方案后一个月内完成。&quot;',NULL,NULL,'待红岛绿洲湿地项目资产处置方案明确后一个月内完成绿洲湿地公司的董监事变更事宜。（10月23日调整）',NULL,'',NULL,'3','1','2017-11-14 18:12:42','2','2018-03-29 10:29:56',NULL,'1');
