INSERT INTO `aams_project` VALUES ('5cc1964869c046e3895dd033bd8d266d','3','20171123203','2','&lt;p&gt;\r\n	380米道路施工完成&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	各分项完成计划：&lt;/p&gt;\r\n&lt;p&gt;\r\n	1、二灰铺设11月30日&lt;/p&gt;\r\n&lt;p&gt;\r\n	2、路缘石安装12月8日&lt;/p&gt;\r\n&lt;p&gt;\r\n	3、下层沥青铺设12月10日&lt;/p&gt;\r\n&lt;p&gt;\r\n	4、检查井起落12月15日&lt;/p&gt;\r\n&lt;p&gt;\r\n	5、上层沥青铺设12月20日&lt;/p&gt;\r\n&lt;p&gt;\r\n	6、人行道路铺设12月30日&lt;/p&gt;','2017-12-31','正常推进',NULL,NULL,'','2017-11-24','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-23 13:36:10','2','2017-11-24 16:55:49',NULL,'0');
INSERT INTO `aams_project` VALUES ('5d8417f158614efb91d2fa88b652c921','3','20180124285','2','&lt;p&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;根据集团党委会要求，组织完成置地公司整体搬迁工作，并协调集团办公室完成预算调整，完成搬迁、装修、家具的规定流程，完成核价结算；完成搬迁后的装饰、保洁、绿植、美化、通讯工作&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;','城投集团','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;根据集团党委会要求，组织完成置地公司整体搬迁工作，并协调集团办公室完成预算调整，完成搬迁、装修、家具的规定流程，完成核价结算；完成搬迁后的装饰、保洁、绿植、美化、通讯工作&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;','2018-02-23','进行中',NULL,NULL,'责任人增加王军、宋宸，建议分值3分','2018-03-01','',NULL,'4','f6161efe2459473d87c59b7100087481','2018-01-24 13:32:12','2','2018-03-01 11:17:21',NULL,'0');
INSERT INTO `aams_project` VALUES ('5ef6db92f2ad456b89f47aa0c93c8066','2','2017103029','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;对横A3路管线破坏修复的协调工作&lt;/span&gt;&lt;/p&gt;','综合部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;继续跟进协调房地产公司关于修复工程进度。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2017年12月21日前提交专题报告。&lt;/span&gt;&lt;/p&gt;','2018-09-30','房地产公司已初步形成资金解决路径，待集团招标会通过后，再进一步推进。集团招标会将于10月30日进行。',NULL,NULL,'继续推进\r\n因为项目出现问题扣5分',NULL,'',NULL,'3','f9ba8b27243845a8a5d28b97e02ce116','2017-10-30 11:06:15','2','2018-01-04 10:26:15',NULL,'1');
INSERT INTO `aams_project` VALUES ('60fa81d0fc484cd3b1cc857912274306','1','20180613375','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;欢乐滨海城绿化及道路移交。（ 挂牌督办）&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;1.欢乐滨海城横A3道路完善问题：经集团安全和工程管理部协调，待地产集团完成道路及管线修复协议签订并解决资金问题后，置地公司协调原道路施工单位3个月内完成污水管线修复和路面修缮工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;2.欢乐滨海城土地审计问题解决后，三个月内土地收储完成。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;3.土地收储完成后三个月内完成施工手续补办并办理道路移交手续。&lt;/span&gt;&lt;/p&gt;','2018-12-31','1、污水管线维修和横A3道路修缮已完成，因维修资金未按合同约定及时支付，纵A4暂不具备移交条件。2、除纵A4外，其余7条道路正在办理移交手续，12月底完成移交。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-06-13 15:38:56','1','2018-12-29 08:59:24',NULL,'0');
INSERT INTO `aams_project` VALUES ('61d8b344070a448783b9ba2d04940ef1','3','20171110175','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;剩余路灯、交通设施控制价编制审查。&lt;/span&gt;&lt;/p&gt;','部门计划','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;1、11月17日前完成路灯控制价。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;2、11月24日前完成交通设施控制价&lt;/span&gt;&lt;/p&gt;','2018-03-31','控制价编制完成，待审查完成后办结事项。',NULL,NULL,'','2018-03-29','',NULL,'4','2','2017-11-10 16:29:29','2','2018-03-29 11:09:18',NULL,'0');
