INSERT INTO `aams_project` VALUES ('64ad397202f34785bd886778e0de039c','1','20171114188','2','&lt;p&gt;\r\n	规范欢乐滨海城项目现场管理用房的管理使用&lt;/p&gt;','工作目标','5322e81fcd36411a8bb8d6ef43f109b8','&lt;p&gt;\r\n	研究欢乐滨海城项目现场管理用房的管理方案，经集团主要领导及相关部门批准后，计划内部招标由专门的管理公司进行现场管理，并签订相关协议。&lt;/p&gt;','2017-11-30','欢乐滨海城项目现场管理用房的管理方案已于5月份上报集团主要领导，经集团主要领导及相关部门阅批并修改后，2017年10月25日资产管理委员会再次上会讨论，根据会议意见再次修改完善，拟月底完成',NULL,NULL,'','2017-12-28','',NULL,'4','1','2017-11-14 18:11:47','2','2017-12-28 10:39:52',NULL,'0');
