INSERT INTO `aams_project` VALUES ('65a48303926c482bb0d9bbf1e2b5e352','2','20180815404','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;置地公司&amp;ldquo;百日攻坚&amp;rdquo;专项活动方案：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;欢乐滨海城信访及政务热线涉及事项一揽子解决方案（挂牌督办）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','公司督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;1.7&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;26&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前确定招标方案，上公司招标会；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;2.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;16&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前招标控制价及招标文件上集团&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;OA&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;系统并完成；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;3.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;23&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前完成控制价定额站备案；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;4.8&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前签订招标代理合同；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;5.9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日前准备招标其它材料；&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;6.9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;日通过集团招标会。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-09-30','正常推进',NULL,NULL,'','2018-10-18','',NULL,'4','1','2018-08-15 14:26:55','1','2018-10-18 15:43:25',NULL,'0');
