INSERT INTO `aams_project` VALUES ('6fba16b3e255449f9972e0c5e640b98e','3','20171115191','2','&lt;p&gt;\r\n	完成已施工的绿化移交.&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	1、11月17日完成绿化带内的杂草、垃圾清理，完成苗木的修剪；&lt;/p&gt;\r\n&lt;p&gt;\r\n	2、11月16日完成拟移交苗木的数量审计；&lt;/p&gt;\r\n&lt;p&gt;\r\n	3、11月24日完成苗木移交（移交书各方签字）。&lt;/p&gt;\r\n&lt;p&gt;\r\n	4、11月底完成苗木移交&lt;/p&gt;','2017-11-30','已与四方园林达成移交共识，对现场进行了检查，提出了整改意见。',NULL,NULL,'','2017-11-30','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-15 08:37:29','2','2017-11-30 15:23:01',NULL,'0');
INSERT INTO `aams_project` VALUES ('70a06687f82e4d81afeffef949e3c688','3','20180124269','2','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;一、道路工程&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;、工程现状：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;欢乐滨海城道路一期工程、&lt;span lang=&quot;EN-US&quot;&gt;A&lt;/span&gt;区横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;路等五条道路已完成移交工作。剩余八条道路施工合同也已经签订完毕。工程实体基本施工完成。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;、存在问题：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;路南段因学校地块施工破坏，纵&lt;span lang=&quot;EN-US&quot;&gt;B9&lt;/span&gt;路因房地产公司三号基坑支护过期需等其基坑回填后再铺设沥青。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;路、纵&lt;span lang=&quot;EN-US&quot;&gt;B6&lt;/span&gt;、纵&lt;span lang=&quot;EN-US&quot;&gt;B7&lt;/span&gt;、横&lt;span lang=&quot;EN-US&quot;&gt;A2&lt;/span&gt;等四条道路土地没有收储，前期手续无法办理，质检安检无法委托。道路正式验收移交无法办理。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;、解决方案：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）待房地产公司落实维修费用及&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;月三号基坑回填零标高后组织实施。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）土地收储后，委托质监站做正式竣工验收后办理移交。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;一、道路工程&lt;/span&gt;&lt;span style=&quot;text-indent: 28pt; font-family: 宋体; font-size: 14pt;&quot;&gt;工作计划：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;~9&lt;/span&gt;月，横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;、纵&lt;span lang=&quot;EN-US&quot;&gt;B9&lt;/span&gt;道路修复工作。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;6&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;~12&lt;/span&gt;月，道路竣工验收及移交工作。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;8&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;~12&lt;/span&gt;月，工程结算审核。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-06-07','',NULL,'4','2','2018-01-24 12:26:24','1','2018-06-07 16:41:20',NULL,'0');
INSERT INTO `aams_project` VALUES ('70b92eb2aa734a429b9db36805775cc5','3','20180111262','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;编写汇总置地、湿地和胜通的银行自查情况表及自查报告&lt;/span&gt;&lt;/p&gt;','资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;按计划编写置地、湿地银行情况表，并汇总胜通银行情况表，编写word报告。&lt;/span&gt;&lt;/p&gt;','2018-01-12','按计划时间节点进行，已填完情况表',NULL,NULL,'','2018-01-26','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2018-01-11 08:10:36','2','2018-01-26 16:22:35',NULL,'0');
INSERT INTO `aams_project` VALUES ('70cf16d4c2c2482ca15b3b57775ee336','3','20180531358','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;获得集团安工部下发优秀班组和优秀员工奖项。&lt;/span&gt;&lt;/p&gt;','集团','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;获得集团安工部对工作的肯定。&lt;/span&gt;&lt;/p&gt;','2018-05-28','已完成',NULL,NULL,'','2018-06-07','',NULL,'4','1','2018-05-31 13:21:56','1','2018-06-07 16:43:33',NULL,'0');
INSERT INTO `aams_project` VALUES ('714c7386d2514be6acdb6a64d64a10b0','3','2017110156','2','&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:\r\n仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;\r\nmso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;\r\nmso-bidi-language:AR-SA&quot;&gt;2017&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:\r\n仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;\r\nmso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;\r\nmso-bidi-language:AR-SA&quot;&gt;年度集团下发组织员工体检的通知，根据通知内容统计公司所有员工的体检项目已经将体检通知要求传达到位，于10月19日16:30上报党群部&lt;/span&gt;&lt;/p&gt;','集团党群部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	1.传达集团组织员工体检的通知&lt;/p&gt;\r\n&lt;p&gt;\r\n	2.统计公司参加体检的人数和体检项目并上报给集团党群部&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2017-10-19','已传达集团组织员工体检的通知并将公司参加体检的人数和体检项目并上报给集团党群部',NULL,NULL,'','2017-11-14','|/aams/userfiles/f6161efe2459473d87c59b7100087481/files/project/aamsProject/2017/11/%E7%BD%AE%E5%9C%B0%E5%85%AC%E5%8F%B8%E5%91%98%E5%B7%A5%E4%BD%93%E6%A3%80%E9%80%89%E6%8B%A9%E6%B1%87%E6%80%BB%E8%A1%A8.xlsx',NULL,'4','f6161efe2459473d87c59b7100087481','2017-11-01 14:59:15','1','2017-11-14 18:19:19',NULL,'0');
INSERT INTO `aams_project` VALUES ('7173c280345d45e9bcb7039d1f065415','3','20180425354','2','&lt;p&gt;\r\n	2018年4月24日参观市反腐倡廉教育基地&lt;/p&gt;','集团组织','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	2018年4月24日参观市反腐倡廉教育基地&lt;/p&gt;','2018-04-24','参观完成',NULL,NULL,'','2018-07-26','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2018-04-25 13:27:59','1','2018-07-26 12:09:17',NULL,'0');
INSERT INTO `aams_project` VALUES ('71c061446d6649aea69f039fbeee4b76','1','20180613373','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;欢乐滨海城环境整治。&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;欢乐滨海城环境整治工作已完成(&amp;ldquo;美丽青岛行动&amp;rdquo;涉及工作). 需就管理责任界定及移交工作尽快与市北区对接。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;1.欢乐滨海城已收储未出让a-1街坊地块、b-3-01商业地块、b-3-14影剧院地块等三地块的渣土及建筑垃圾由置地公司负责，已按照市北区滨海办要求清运了垃圾，增设了围挡，并密目网覆盖。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;2.欢乐滨海城未收储地块的渣土及建筑垃圾由胜通公司负责，已按照市北区滨海办要求完成了密目网覆盖，并清运垃圾，增设了围挡。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;3.欢乐滨海城道路两侧居民倒弃垃圾的问题，由城管执法部门进行处理，并于4月25日正式向市北区滨海新区管委会发函，经努力协调，市北区有关部门已初步同意该解决方案和界定责任的意见，将于近期正式向集团或置地公司函复书面意见。&lt;/span&gt;&lt;/p&gt;','2018-05-31','已完成',NULL,NULL,'','2018-06-28','|/aams/userfiles/1/files/project/aamsProject/2018/06/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E7%8E%AF%E5%A2%83%E6%95%B4%E6%B2%BB%E7%AB%A3%E5%B7%A5%E9%AA%8C%E6%94%B62.jpg|/aams/userfiles/1/files/project/aamsProject/2018/06/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E7%8E%AF%E5%A2%83%E6%95%B4%E6%B2%BB%E7%AB%A3%E5%B7%A5%E9%AA%8C%E6%94%B6.jpg',NULL,'4','1','2018-06-13 15:32:19','1','2018-06-28 09:50:03',NULL,'0');
INSERT INTO `aams_project` VALUES ('7248dd9c3c814640bccd35609cbd0dd1','1','20181108420','2','&lt;p&gt;\r\n	确定瑞海北路17号北侧墙外空地责任人（第25次党委会（20180908））&lt;/p&gt;','集团办公室','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	1、9月底，制定现场巡查制度，并发送给现场管理公司。&lt;/p&gt;\r\n&lt;p&gt;\r\n	2、10月底之前，确定空地管理责任主体及置地公司公司现场管理直接责任人。&lt;/p&gt;','2018-10-31','已完成',NULL,NULL,'',NULL,'|/aams/userfiles/1/files/project/aamsProject/2018/11/%E5%B7%A1%E6%9F%A5%E5%88%B6%E5%BA%A61.png|/aams/userfiles/1/files/project/aamsProject/2018/11/%E5%B7%A1%E6%9F%A5%E5%88%B6%E5%BA%A62.png',NULL,'3','1','2018-11-08 08:56:58','1','2018-12-29 08:59:40',NULL,'0');
INSERT INTO `aams_project` VALUES ('732c1a7456154403a9ae6641ae000674','3','20171103140','2','&lt;p&gt;\r\n	按资金部要求完成11月份资金计划报送。&lt;/p&gt;','集团资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	及时填写资金计划，按要求时间报送&lt;/p&gt;','2017-11-30','按资金部要求时间报送',NULL,NULL,'',NULL,'',NULL,'5','add6f72a55a74829b75ce9da0fd9726b','2017-11-03 16:10:31','2','2017-11-10 14:34:39',NULL,'0');
INSERT INTO `aams_project` VALUES ('735c64492de24723929cc1d0b448ee7a','3','20171222250','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;集团安全部要求上报公司本年度安全生产标准化所有相关材料及运行情况，待审核过后送市安监局接受抽查，针对集团安全部审核材料过程中查出的不适应项随时整理改进&lt;/span&gt;&lt;/p&gt;','集团安全部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;集团安全部要求上报公司本年度安全生产标准化所有相关材料及运行情况&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;待审核过后送市安监局接受抽查&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;针对集团安全部审核材料过程中查出的不适应项随时整理改进&lt;/span&gt;&lt;/p&gt;','2017-12-29','进行中',NULL,NULL,'','2018-01-26','',NULL,'4','f6161efe2459473d87c59b7100087481','2017-12-22 15:15:30','2','2018-01-26 16:26:03',NULL,'0');
