INSERT INTO `aams_project` VALUES ('799f1034a397424ebfdc0d4f01a1747d','3','20171208238','2','&lt;p style=&quot;TEXT-ALIGN: justify; LINE-HEIGHT: 28pt; TEXT-INDENT: 32pt; MARGIN: 0cm 0cm 0pt; FONT-FAMILY: \'Calibri\',sans-serif; FONT-SIZE: 10.5pt&quot;&gt;\r\n	&lt;span style=&quot;font-family: 仿宋, 仿宋_GB2312; font-size: 21.3333px; line-height: 37.3333px; text-indent: 42.6667px;&quot;&gt;于12月8日（本周五）下班前，&lt;/span&gt;&lt;span style=&quot;FONT-FAMILY: 仿宋,仿宋_GB2312; FONT-SIZE: 16pt&quot;&gt;上报集团工会协调量体工作联系人，召集本单位人员及时测量。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;TEXT-ALIGN: justify; LINE-HEIGHT: 28pt; TEXT-INDENT: 32pt; MARGIN: 0cm 0cm 0pt; FONT-FAMILY: \'Calibri\',sans-serif; FONT-SIZE: 10.5pt&quot;&gt;\r\n	&lt;span style=&quot;FONT-FAMILY: 仿宋,仿宋_GB2312; FONT-SIZE: 16pt&quot;&gt;并于12月11日（下周一）前将《工装费用发票开票信息统计表》电子版报党群部联系人公务邮箱。&lt;/span&gt;&lt;/p&gt;','集团总工会','19b99420a1f944dbbb37f2c53f57ce41','&lt;p style=&quot;font-size: 10.5pt; text-align: justify; line-height: 28pt; text-indent: 32pt; margin: 0cm 0cm 0pt; font-family: Calibri, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 仿宋, 仿宋_GB2312; font-size: 21.3333px; line-height: 37.3333px; text-indent: 42.6667px;&quot;&gt;于12月8日（本周五）下班前，&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋, 仿宋_GB2312; font-size: 16pt;&quot;&gt;上报集团工会协调量体工作联系人，召集本单位人员按照集团共总会安排时间及时测量。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-size: 10.5pt; text-align: justify; line-height: 28pt; text-indent: 32pt; margin: 0cm 0cm 0pt; font-family: Calibri, sans-serif;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 仿宋, 仿宋_GB2312; font-size: 16pt;&quot;&gt;并于12月11日（下周一）前将《工装费用发票开票信息统计表》电子版报党群部联系人公务邮箱。&lt;/span&gt;&lt;/p&gt;','2017-12-11','进行中',NULL,NULL,'','2017-12-15','',NULL,'4','f6161efe2459473d87c59b7100087481','2017-12-08 18:07:23','2','2017-12-15 11:35:22',NULL,'0');
