INSERT INTO `aams_project` VALUES ('7affe48fe68c4df5b0b36fc65cb46cbd','2','20180815405','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司&amp;ldquo;百日攻坚&amp;rdquo;专项活动方案：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;欢乐滨海城剩余道路竣工验收。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','公司督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第一周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;7.24-26&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：完成并提交相关材料&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第二周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;7.27-8.2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：资料审核&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第三周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;8.3-9&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：取得《行政处罚决定书》&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第四周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;8.10-16&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：完成罚款&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第五周&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;-&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第八周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;8.17-9.13&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）办理完成合同备案&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第九周&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;-&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第十二周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;9.14-10.12&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;办理施工许可证&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;line-height: 12pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第十三周&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;-&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第十四周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;10.13-26&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：办理质检安检委托&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;第十五周（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif;&quot;&gt;10.27&lt;/span&gt;&lt;span style=&quot;font-family: 宋体;&quot;&gt;）：开始现场整修。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-29','|/aams/userfiles/1/files/project/aamsProject/2018/08/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E5%89%A9%E4%BD%99%E9%81%93%E8%B7%AF%E7%AB%A3%E5%B7%A5%E9%AA%8C%E6%94%B6%E8%AE%A1%E5%88%92%E8%A1%A8.docx',NULL,'4','1','2018-08-15 14:30:57','1','2018-12-29 11:20:01',NULL,'0');
INSERT INTO `aams_project` VALUES ('7bb427ffec2c4bba89972b752fe46906','1','20171114183','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px&quot;&gt;欢乐滨海城绿化及道路移交。（挂牌督办）&lt;/span&gt;&lt;/p&gt;','20160622督办调度会','4ca607d0cd50428083776ecbb4bd4c05','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;1、8条道路中已完成6条道路的完善，剩余两条道路（横A3、纵B9）因地下污水管线破坏无法施工，待地产集团修复污水管线施工完成后，我公司将在一个月内完成剩余两条道路完善工作。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 24px;&quot;&gt;2.欢乐滨海城土地审计问题解决后，三个月内土地收储完成。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 24px;&quot;&gt;3.土地收储完成后三个月内完成施工手续补办并办理道路移交手续。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;mso-spacerun:\'yes\';font-family:仿宋;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2017-12-31','&quot;1.欢乐滨海城绿化移交已经完成，2017年养护费用已支付，2018年养护费用由市北区承担。\r\n2.（待调整）&quot;',NULL,NULL,'土地收储完成后三个月内完成施工手续补办并办理道路移交手续。',NULL,'',NULL,'3','1','2017-11-14 17:31:33','2','2018-03-29 14:48:56',NULL,'1');
