INSERT INTO `aams_project` VALUES ('7cca8534afe1406f91d1960e3681f51d','2','20180223305','2','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;完成春节期间值班安排与组织工作，完成节后首个工作日的团拜、收看直播的组织工作，及时向集团办公室报送收看情况及照片&lt;/font&gt;&lt;/span&gt;&lt;span style=&quot;mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','集团办公室督办','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	完成春节期间值班安排及组织工作，完成节后首个工作日团拜及收看直播节目，及时向集团办公室报送收看情况和照片&lt;/p&gt;','2018-03-08','已完成',NULL,NULL,'',NULL,'',NULL,'3','2','2018-02-23 15:55:44','2','2018-02-23 15:55:44',NULL,'1');
