INSERT INTO `aams_project` VALUES ('7e7c89d4b96e4c719aa4b3fa234abe92','3','20181112421','2','&lt;p&gt;\r\n	整理置地应收应付款&lt;/p&gt;','置地','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 22px;&quot;&gt;按要求将置地公司账面应收应付款余额、形成原因等进行梳理&lt;/span&gt;&lt;/p&gt;','2018-11-22','已按要求将置地公司账面应收应付款余额、形成原因等进行梳理',NULL,NULL,'','2018-12-13','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2018-11-12 16:31:46','1','2018-12-13 10:40:28',NULL,'0');
INSERT INTO `aams_project` VALUES ('7f013811107f41a1b24389f9f080bc25','3','20171114180','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;参加集团战略发展部组织的平度医疗中心PPP项目学习。&lt;/span&gt;&lt;/p&gt;','集团','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	11月14日一早跟集团战略部和其他产业集团一起赴平度医疗中心项目参观学习。&lt;/p&gt;','2017-11-14','已完成。',NULL,NULL,'','2017-11-15','',NULL,'4','48433cda981346578a4515c15d5d5800','2017-11-14 16:52:50','2','2017-11-15 10:34:51',NULL,'0');
INSERT INTO `aams_project` VALUES ('7f26e887deb447068b04288e5548f2a0','2','20180926415','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 18px;&quot;&gt;协助市北区滨海新区启动A-1C地块招拍挂工作&lt;/span&gt;&lt;/p&gt;','公司办公会','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	1.9月底，向国土局提交启动A-1C地块招拍挂工作的申请，完成地形图测绘工作，启动该地块的土地环保审查工作。&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 16px;&quot;&gt;2.10月上旬，向土储中心提交申请规划设计条件的材料。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 16px;&quot;&gt;3.10月底，争取取得正式规划设计条件，完成土地环保审查工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 16px;&quot;&gt;4.11月底，国土局完成地价评估工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 16px;&quot;&gt;5.12月下旬，完成供地方案审批。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 16px;&quot;&gt;6.12月底，发布招拍挂公告。&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-29','',NULL,'4','f58e81cf534f498d92119f82ce355540','2018-09-26 15:28:52','1','2018-12-29 11:23:30',NULL,'0');
INSERT INTO `aams_project` VALUES ('80e289944bf24d738f4b2138ea53a9d2','3','20180719391','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;6月23日安全生产宣传日登报.&lt;/span&gt;&lt;/p&gt;','集团安全月要求','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;6月25日完成登报&lt;/span&gt;&lt;/p&gt;','2018-06-25','已经完成登报',NULL,NULL,'作为省级刊物发表文章','2018-08-02','|/aams/userfiles/c3a9f2ea38964ad8821431ac5bc6ddd0/files/project/aamsProject/2018/07/%E6%8A%A5%E7%BA%B8.jpg|/aams/userfiles/c3a9f2ea38964ad8821431ac5bc6ddd0/files/project/aamsProject/2018/07/%E6%8A%A5%E7%BA%B81.jpg',NULL,'4','c3a9f2ea38964ad8821431ac5bc6ddd0','2018-07-19 12:41:53','1','2018-08-02 11:38:35',NULL,'0');
INSERT INTO `aams_project` VALUES ('8115bd362ca344c895d7ccb6d1cba0ba','3','20171122197','2','&lt;p&gt;\r\n	完善部门电子资料库工作，完成搜集与项目有关的网络资料建档工作。完成项目有关文件的网络审批流程申报工作。&lt;/p&gt;','投资部','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	下周五下班之前前完成相关工作！&lt;/p&gt;','2017-12-01','相关工作还在继续完善中，有部分网上资料还需耐心查找，确保搜集资料的准确性和真实性。',NULL,NULL,'网络资料的查找存在一定难度，所以需要耐心和时间上的相对延伸。',NULL,'',NULL,'5','f97df342706947d189491bd395b7a6c7','2017-11-22 09:14:37','2','2017-11-23 15:52:24',NULL,'0');
INSERT INTO `aams_project` VALUES ('81ceb3038a4440f0995c2d628df2b2af','2','20180124270','2','&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt; mso-char-indent-count: 2.0;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;双子塔地块于&lt;span lang=&quot;EN-US&quot;&gt;2013&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;9&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;27&lt;/span&gt;日，由绿地控股集团有限公司竞拍取得，土地出让金总额为&lt;span lang=&quot;EN-US&quot;&gt;30248.9&lt;/span&gt;万元，合同约定&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2013&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;11&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;14&lt;/span&gt;日前缴纳&lt;span lang=&quot;EN-US&quot;&gt;50%&lt;/span&gt;，&lt;span lang=&quot;EN-US&quot;&gt;2014&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;10&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;14&lt;/span&gt;日前缴纳剩余&lt;span lang=&quot;EN-US&quot;&gt;50%,&lt;/span&gt;。城投集团已于&lt;span lang=&quot;EN-US&quot;&gt;2013&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;12&lt;/span&gt;月取得首批&lt;span lang=&quot;EN-US&quot;&gt;50%&lt;/span&gt;土地出让金返还&lt;span lang=&quot;EN-US&quot;&gt;10071.92&lt;/span&gt;万元，剩余&lt;span lang=&quot;EN-US&quot;&gt;50%&lt;/span&gt;土地出让金&lt;span lang=&quot;EN-US&quot;&gt;10156&lt;/span&gt;万元尚未取得，主要系因世奥海大浮山校区土地置换项目原因无法取得市土地储备中心开具的无垫款证明。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt; mso-char-indent-count: 2.0;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;、&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;月底前，落实清楚世奥海大浮山校区土地置换项目未缴纳土地出让金的来龙去脉。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt; mso-char-indent-count: 2.0;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;、&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;月份，与资金部宁部长一同去财政局综合处解释双子塔地块&lt;span lang=&quot;EN-US&quot;&gt;50%&lt;/span&gt;的土地出让金未返还及世奥海大浮山校区土地置换项目土地出让金情况。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt; mso-char-indent-count: 2.0;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;、若财政局综合处认可双子塔地块与世奥海大浮山校区土地置换项目互不牵扯，同意支付土地补偿金，财务部将立即提交相关申请材料尽快申请土地出让金返还。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt; mso-char-indent-count: 2.0;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 14pt; mso-bidi-font-weight: bold;&quot;&gt;、若财政局综合处认为世奥海大浮山校区土地置换项目城投集团应支付&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;亿多土地出让金后，才能支付双子塔地块&lt;span lang=&quot;EN-US&quot;&gt;50%&lt;/span&gt;的土地出让金，财务部将协调集团财务部寻找解决途径。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-29','|/aams/userfiles/2/files/project/aamsProject/2018/01/%E8%B4%A2%E5%8A%A1%E9%83%A82018%E5%B9%B4%E5%B7%A5%E4%BD%9C%E8%AE%A1%E5%88%92.docx',NULL,'4','2','2018-01-24 12:28:33','1','2018-12-29 11:24:19',NULL,'0');
