INSERT INTO `aams_project` VALUES ('84f6a4719389451ab2069a924bb565e8','3','20171129216','2','&lt;p&gt;\r\n	向集团战略部韦思雨提报置地公司前期开发项目汇总表，并与战略部吴东对接网签联签相关事宜及程序。将王总签字的关于置地公司前期开发项目的汇总表进行电子存档及文件存档。&lt;/p&gt;','投资部','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	本日内完成提交及沟通工作。与部门领导沟通对接联签文件的修改及二次提报的工作，准备联签的第二次网签提报。&lt;/p&gt;','2017-11-29','与战略部吴东已经进行对接沟通，汇总表已经通过公务邮箱发至战略部韦思雨处并将签字原件交给对方，对方电子邮件和签字原件均已接收。待与部门领导沟通后准备二次联签的提报工作。',NULL,NULL,'',NULL,'',NULL,'5','f97df342706947d189491bd395b7a6c7','2017-11-29 11:07:17','48433cda981346578a4515c15d5d5800','2017-11-30 10:48:51',NULL,'0');
INSERT INTO `aams_project` VALUES ('8527323aa1264dd5911181a769405ae7','2','2017103030','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;路灯箱变过户移交&lt;/span&gt;&lt;/p&gt;','工程部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1、2017年12月28日，开始进行移交手续办理。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2、2018年1月10日，过户移交完成。&lt;/span&gt;&lt;/p&gt;','2018-01-23','准备相关的移交过户资料。',NULL,NULL,'','2018-01-26','',NULL,'4','f9ba8b27243845a8a5d28b97e02ce116','2017-10-30 11:13:04','2','2018-01-26 16:07:13',NULL,'0');
INSERT INTO `aams_project` VALUES ('8538a2183748497f9bbea86a7defd8a5','1','2017110133','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;置地公司要落实市审计报告认定的欢乐滨海城土地收储多付补偿款事项，积极与胜通公司相关股东沟通协调，将前期多付的土地补偿款从后续土地收储的应付补偿金中扣减冲抵。&lt;/span&gt;&lt;/p&gt;','集团半年业绩分析会暨部门督办调度会议督办事项（20160713）','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;胜通公司召开股东会后，根据股东会决议及集团指示，1个月内落实审计提出问题的实施路径报告。该方案报集团审批通过后，6个月内按集团意见完成审计整改工作。 1.对接国土局解决方案的可行性及具体的实施路径； 2.对接审计局此种处理方式的可行性； 3.落实上述部门均无问题后，向国土局或者市政府正式请示。&lt;/span&gt;&lt;/p&gt;','2017-12-31','10月20日，集团分管领导主持召开与国土局相关部门的对接会，国土局提出需要再进一步补充资料，之后再行对接研究具体的实施路径。预计11月中旬补齐材料约见国土局相关部门对接。',NULL,NULL,'股东会决策同意后一个月内签订协议。',NULL,'',NULL,'3','2','2017-11-01 09:47:22','2','2017-11-02 10:34:35',NULL,'1');
