INSERT INTO `aams_project` VALUES ('94dbd8cf6eb24f34b097b708270d68ca','2','20180712389','2','&lt;p&gt;\r\n	胶南项目工作计划。&lt;/p&gt;','公司督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	一、2018年7月9日至2018年7月27日间收集项目资料和有关数据。&lt;/p&gt;\r\n&lt;p&gt;\r\n	二、2018年7月9日至2018年7月27日间与陆丰公司沟通，确定项目拆迁具体时间安排。&lt;/p&gt;\r\n&lt;p&gt;\r\n	三、2018年7月30日至8月1日间，在完成（一）（二）的基础上，与陆丰确定年内可开始拆迁工作，则开始项目合作，明确我方不参与拆迁。&lt;/p&gt;\r\n&lt;p&gt;\r\n	四、2018年7月19日至8月17日间，收集项目相关政策，明确是否可以依托新旧动能及其他利好政策。&lt;/p&gt;\r\n&lt;p&gt;\r\n	五、2018年8月2日至8月22日，在完成（三）的基础上，确定拆迁政策及补偿方案。&lt;/p&gt;\r\n&lt;p&gt;\r\n	六、2018年8月23日至9月5日，在完成（五）的基础上，根据集团成立合资公司具体政策，与陆丰探讨合作模式，明确我方介入时间为拆迁完成后。&lt;/p&gt;\r\n&lt;p&gt;\r\n	七、2018年9月6日至9月10日，在完成（六）的基础上，根据集团成立合资公司政策，如双方就股权占比达成一致，则继续合作。&lt;/p&gt;\r\n&lt;p&gt;\r\n	八、2018年8月2日至9月19日，在完成（三）的基础上，与陆丰沟通，确定具体设计规划方案，明确商业占比。&lt;/p&gt;\r\n&lt;p&gt;\r\n	九、2018年9月6日至9月19日，在完成（六）的基础上，双方协商完成合作协议编制。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十、2018年7月9日至9月5日，收集集团及其他资金方政策，明确项目资金来源。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十一、2018年9月20日至10月3日，在完成（三）、（四）、（五）、（八）、（九）、（十）的基础上，根据拆迁方案、项目规划设计、合作模式、资金来源完成项目建议书及初步金融测算。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十二、2018年10月4日至10月17日，在完成（十一）的基础上，项目建议书报集团审批。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十三、2018年10月18日至10月24日，在完成（十二）的基础上，建议书集团审批通过后，申请项目前期资金。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十四、2018年10月25日至11月14日，在完成（十三）的基础上，前期资金到位后，聘请专业机构对合作单位进行尽职调查。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十五、2018年11月15日至11月21日，在完成（十四）的基础上，尽职调查报告报公司内部审批，审批通过后继续合作。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十六、2018年10月25日至11月14日，在完成（十三）的基础上，与陆丰合作，共同聘请专业机构完成项目可行性研究报告编制。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十七、2018年11月22日至12月5日，在完成（十五）、（十六）的基础上，根据可研报告、资金成本、其他政策更新，完成详细项目金融分析。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十八、2018年12月6日至12月26日，在完成（十七）的基础上，根据可研报告、金融分析编制上会材料，提报战略会决议。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十九、2018年12月27日至2019年1月9日，在完成（十八）的基础上，如战略会通过，根据会议精神修改合作协议及其他资料。&lt;/p&gt;\r\n&lt;p&gt;\r\n	二十、2019年1月10日至2月20日，在完成（十九）的基础上，调整完成后提报编制董事会汇报材料，提报董事会决议。&lt;/p&gt;','2019-02-20','正常推进',NULL,NULL,'','2018-12-20','',NULL,'4','1','2018-07-12 09:11:39','1','2018-12-20 16:29:43',NULL,'0');
