INSERT INTO `aams_project` VALUES ('9991660922cc47fb813b7263397367cf','2','20180315341','2','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;color: rgb(68, 68, 68); font-family: 宋体; font-size: 15pt;&quot;&gt;根据《城投集团出租房消防安全综合治理工作方案》及青岛市安委会相关要求，全面加强出租房屋消防安全管理，在&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: rgb(68, 68, 68); font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: 宋体; font-size: 15pt;&quot;&gt;月份至&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: rgb(68, 68, 68); font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: 宋体; font-size: 15pt;&quot;&gt;月份期间按阶段提报六份材料。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: rgb(68, 68, 68); font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: rgb(68, 68, 68); font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','集团安委会责任部门工程部','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;、&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;月起，每月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;25&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;日上报当月工程开展情况。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 10.5pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;、&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;日，报送租房统计表，与承租方签订的消防协议。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 10.5pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;、&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 15pt;&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;font-size: 15pt;&quot;&gt;日前汇总消防安全综合治理工作总结。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Helvetica, sans-serif; font-size: 10.5pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','2018-05-31','已完成',NULL,NULL,'','2018-06-07','',NULL,'4','2','2018-03-15 16:59:11','1','2018-06-07 16:12:45',NULL,'0');
