INSERT INTO `aams_project` VALUES ('9e90687c79334143bba600402d3aab31','1','20180613374','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;欢乐滨海城信访及政务热线涉及事项要提出一揽子解决方案。（ 挂牌督办）&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1.路灯：5月完成欢乐滨海城小区路灯建设。（5月底前完成移交）&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2.道路：欢乐滨海城横A3道路完善问题：经集团安全和工程管理部协调，待地产集团完成道路及管线修复协议签订并解决资金问题后，置地公司协调原道路施工单位3个月内完成污水管线修复和路面修缮工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;3.路面标线：6月完成滨海学校周围路面标线磨损问题。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;4.信号灯安装：10月完成欢乐滨海城交通设施工程招标工作，12月底前完成工程建设、竣工及移交工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;5.横B3道路：完善问题为市建委开发局负责。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;6.欢乐滨海城执法问题：由交管部门，城管执法部门负责。（已完成）&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;7.瑞海北路7号滨海学校北面，工地施工将无名路封闭，影响周围居民出行问题，该处路段已协调相关单位于4月12日之前开通人行通道，方便周边居民出行。（已完成）&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;8胜通海岸小区问题与胜通公司取得联系，由胜通公司派出一名联络员，专项负责胜通海岸小区信访工作，我公司负责联络工作，将信访人问题及时反馈到胜通公司，督促其尽快办理。（已完成）&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;','2018-09-30','1、污水管线维修和横A3道路修缮已完成，因维修资金未按合同约定及时支付，纵A4暂不具备移交条件。2、信号灯等交通设施已于12月20日全部安装完成，正在进行调试，本月底完成移交。3、除纵A4外，其余7条道路正在办理移交手续，12月底完成移交。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-06-13 15:37:23','1','2018-12-29 09:00:41',NULL,'0');
INSERT INTO `aams_project` VALUES ('9ee71954870046c680610b4e01ec08c0','3','2017110177','2','&lt;p&gt;\r\n	上报集团安全部10月份安全月报&lt;/p&gt;','集团安全部','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	总结10月份公司安全生产工作并上报到集团安全部邮箱&lt;/p&gt;','2017-10-26','10月份安全生产月报已提交集团安全部',NULL,NULL,'','2017-11-14','|/aams/userfiles/f6161efe2459473d87c59b7100087481/files/project/aamsProject/2017/11/%E9%9D%92%E5%B2%9B%E5%9F%8E%E6%8A%95%E7%BD%AE%E5%9C%B0%E5%BC%80%E5%8F%91%E6%9C%89%E9%99%90%E5%85%AC%E5%8F%B8%E5%AE%89%E5%85%A8%E6%9C%88%E6%8A%A5%EF%BC%88%E5%8D%81%EF%BC%89.docx',NULL,'4','f6161efe2459473d87c59b7100087481','2017-11-01 15:48:29','1','2017-11-14 18:29:23',NULL,'0');
INSERT INTO `aams_project` VALUES ('9efd0f3a9a1c463c9757334b0462ec82','3','20181229429','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;根据集团董事长安排，由集团总经理亲自牵头，整理湿地设计问题。&lt;/span&gt;&lt;/p&gt;','集团工作安排','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;由聂总负责，综合部配合，完成关于湿地公园设计历史遗留问题汇报材料和附件整理工作。&lt;/span&gt;&lt;/p&gt;','2018-12-30','正常推进',NULL,NULL,'',NULL,'',NULL,'3','c3a9f2ea38964ad8821431ac5bc6ddd0','2018-12-29 12:17:54','1','2018-12-29 15:41:09',NULL,'0');
INSERT INTO `aams_project` VALUES ('a23c928a73894efcbacd11e39d41e9bb','1','20180613377','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 26px;&quot;&gt;双子塔协议签订。&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;1.12月底前完善税收返还方案的及协议草稿的拟定，并积极与市北区政府进行沟通。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:24px;&quot;&gt;2.2019年1月份，在市北区政府同意的前提下，完成项目的协议签订。&lt;/span&gt;&lt;/p&gt;','2018-12-31','项目尚未形成税收，市北区政府相关部门建议待项目建设基本完成，有预期的税收收入后再研究税收返还方案并签订相关协议',NULL,NULL,'',NULL,'',NULL,'3','1','2018-06-13 15:45:30','1','2018-12-29 09:01:26',NULL,'0');
