INSERT INTO `aams_project` VALUES ('a6da08fd8e774f4abb8376d16da30589','3','20171212241','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;根据市政府国资委党委以及集团要求，分别订阅《求是》、《大众日报》、《青岛日报》、《光明日报》、《半月谈》、《秘书工作》报工作，开具征订发票，上报集团，完成党报党刊征订任务。&lt;/span&gt;&lt;/p&gt;','集团办公室','189439fa873243cab9304f404e74549e','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1、根据市政府国资委党委以及集团要求，于崂山邮局中韩分局订阅《求是》、《大众日报》、《光明日报》、《半月谈》、《秘书工作》，于青岛日报崂山发行站订阅《青岛日报》。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2、开具征订发票，上报集团，完成党报党刊征订任务。&lt;/span&gt;&lt;/p&gt;','2017-12-15','进行中',NULL,NULL,'','2017-12-15','',NULL,'4','f6161efe2459473d87c59b7100087481','2017-12-12 19:41:24','2','2017-12-15 11:47:20',NULL,'0');
