INSERT INTO `aams_project` VALUES ('b396e5743bb547ef939bb196fbc5cc1d','1','2017110132','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;落实与市北区政府联席会议确定的事项（道路移交、绿化工程移交等事项）&lt;/span&gt;&lt;/p&gt;','20160622督办调度会','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;3月份提报道路及绿化工程实施专项报告，经集团批准后，6个月内完工。4月份与市北区城管局进行对接，明确道路及绿化移交路径及方案。(道路移交已办结)&lt;/span&gt;&lt;/p&gt;','2017-12-31','1.目前已完工道路的移交工作已办结。                 2.现场苗木清点及核对等移交准备工作已完成，因部分苗木遭受病虫害等原因枯死，接收单位以此为由，表示需得到市北区主要领导按现状移交的明确指示。滨海管委会正在协调杨区长与集团陈总的面议协商。绿化结算审计主要针对拟移交部分工程（尚有部分未施工不具备移交条件），待接收单位明确移交范围、方式和时间后，25天内完成结算审计。                                    3.岸线整治：根据市建委2016年1月5日给市政府办公厅提报的《关于欢乐滨海城资金平衡问题有关事宜的报告》，欢乐滨海城岸线工程等未完成项目后续由市建委负责组织建设。（报告已提报集团办公室）',NULL,NULL,'7月底，市北区政府相关部门同意接受后，3个月内完成移交工作。',NULL,'',NULL,'3','2','2017-11-01 09:42:32','2','2017-11-02 10:41:30',NULL,'1');
