INSERT INTO `aams_project` VALUES ('b5143bf6a46e4adbb81b71d7f8272192','1','20171114185','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px&quot;&gt;协调争取欢乐滨海城资金平衡。&lt;/span&gt;&lt;/p&gt;','集团半年业绩分析会暨部门督办调度会议督办事项（20160713）','4ca607d0cd50428083776ecbb4bd4c05','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;309&quot; style=&quot;height: 231.75pt; mso-height-source: userset&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;309&quot; style=&quot;border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: transparent; width: 695pt; height: 231.75pt; border-top: windowtext; border-right: windowtext&quot; width=&quot;927&quot;&gt;\r\n				&lt;span style=&quot;font-size: 24px&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;1.审计事项整改方案通过并整改完成后，1个月内完成整个项目的预测算，2个月内完成土地收储，6个月内完成施工，并进行竣工验收工作；&lt;br /&gt;\r\n				2.项目竣工验收结束后，申请项目工程审计。&lt;br /&gt;\r\n				3.待工程审计完成并取得审计报告后，3个月内完善资金方案分析报告，并按照市政府会议纪要【2012】第42号要求，完成资金缺口测算及资金平衡措施，上报市政府进行审议。&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;309&quot; style=&quot;height: 231.75pt; mso-height-source: userset&quot;&gt;\r\n			&lt;td class=&quot;xl67&quot; height=&quot;309&quot; style=&quot;border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: transparent; width: 695pt; height: 231.75pt; border-top: windowtext; border-right: windowtext&quot; width=&quot;927&quot;&gt;\r\n				&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2018-12-31','审计整改事项未完成，不具备测算条件、土地收储条件，后续工作无法开展。',NULL,NULL,'工程审计完成后3个月内提报资金缺口测算及资金平衡方案报告。',NULL,'',NULL,'3','1','2017-11-14 18:06:41','2','2018-03-29 10:50:21',NULL,'1');
