INSERT INTO `aams_project` VALUES ('c26ba0bee5b2423ba6cad6c8d04ed08c','2','20171110167','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1、与葛洲坝集团签订战略协议&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2、葛洲坝和城投集团联合体与即墨区政府签订框架协议&lt;/span&gt;&lt;/p&gt;','公司督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;11月中旬完成框架协议终稿；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;11月底督促葛洲坝集团完成框架协议的审批程序；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;12月上旬完成城投集团框架协议的联签审批程序及法律文书审批程序；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;12月底前完成协议签订。&lt;/span&gt;&lt;/p&gt;','2017-12-31','葛洲坝集团的内部审批程序已结束，城投集团的框架协议联签程序正在进行中。',NULL,NULL,'','2017-12-28','',NULL,'4','2','2017-11-10 15:54:04','2','2017-12-28 11:20:27',NULL,'0');
