INSERT INTO `aams_project` VALUES ('c3bd374815154b27a6402bd1b0ecf05d','1','2017110131','2','&lt;p&gt;\r\n	双子塔协议签订&lt;/p&gt;','重点工作','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	加强与市北区滨海办的联系与沟通，争取协议尽早上区长办公会审议通过。&lt;/p&gt;','2017-11-30','绿地公司取得双子塔地块之后迟迟未动工建设，市北区政府的意见是因项目未实施没有税收来源，暂不签订协议，待项目明确后再研究相关问题。',NULL,NULL,'继续推进,市北区政府上会通过后3个月内签订完成。',NULL,'',NULL,'3','2','2017-11-01 09:41:35','2','2017-11-10 13:39:02',NULL,'1');
INSERT INTO `aams_project` VALUES ('c46c0c6c4e534d00a55f599e4a81f5ca','2','20180124271','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;绿化工程 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1、工程现状：工程基本施工完毕。已完成绿化移交工作。现正进行绿化工程结算审计阶段。&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2018年1月~6月，完成结算审核。&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;','2018-07-02','正常推进',NULL,NULL,'',NULL,'|/aams/userfiles/2/files/project/aamsProject/2018/01/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E5%B8%82%E6%94%BF%E9%85%8D%E5%A5%972018%E5%B9%B4%E5%B7%A5%E7%A8%8B%E8%AE%A1%E5%88%92.doc|/aams/userfiles/2/files/project/aamsProject/2018/01/%E5%B7%A5%E7%A8%8B%E9%83%A82018%E5%B9%B4%E8%BF%9B%E5%BA%A6%E8%AE%A1%E5%88%92%E6%B1%87%E6%80%BB%E5%B7%A5%E4%BD%9C%E8%A1%A8.xls',NULL,'3','2','2018-01-24 12:32:33','2','2018-01-24 12:32:33',NULL,'1');
