INSERT INTO `aams_project` VALUES ('c4ad3b24eaf74124928f4542fd208e10','2','20180730395','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司2017年管控整改核查事项：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;人力资源管控：1.制度建设落实不到位，进度不平衡。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2.工作流程不完善，程序不规范。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;3.工作基础较为薄弱，精细化程度不高。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;4.人员选拔缺失公示程序。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;5.薪酬发放不规范。&lt;/span&gt;&lt;/p&gt;','公司督办','7a04dbedd53b485c96e38d283798ddc2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;7月27日完成整改并迎接集团管控检查。&lt;/span&gt;&lt;/p&gt;','2018-07-27','已完成',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-30 10:13:54','1','2018-09-20 15:45:58',NULL,'0');
