INSERT INTO `aams_project` VALUES ('c9198db3fc18450e838ce8ed4c56532b','2','20180711388','2','&lt;p&gt;\r\n	舞阳路项目工作计划。&lt;/p&gt;','公司督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	一、7月4日前完成项目建议书编制和审批。&lt;/p&gt;\r\n&lt;p&gt;\r\n	二、7月12日上会前向战略部委员各成员部门征询意见。&lt;/p&gt;\r\n&lt;p&gt;\r\n	三、7月25日前完成项目咨询合同的询价、审批及签订。&lt;/p&gt;\r\n&lt;p&gt;\r\n	四、7月25日前完成配合市北城发于水务集团进行土地补偿谈判条件。&lt;/p&gt;\r\n&lt;p&gt;\r\n	五、7月30日前将修改后的项目可研报告提交战略委员会通过。&lt;/p&gt;\r\n&lt;p&gt;\r\n	六、8月30日前将项目投资事项提交集团董事会审议通过。&lt;/p&gt;\r\n&lt;p&gt;\r\n	七、9月30日前配合市北城发与水务集团进行土地补偿签订协议。&lt;/p&gt;\r\n&lt;p&gt;\r\n	八、10月20日前完成规划方案并经规划局审议通过。&lt;/p&gt;\r\n&lt;p&gt;\r\n	九、11月30日前完成公司架构、章程等谈判，完成公司注册。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十、2019年1月31日前完成土地整理并入储。&lt;/p&gt;\r\n&lt;p&gt;\r\n	十一、2019年2月28日前完成土地竞拍。&lt;/p&gt;','2019-02-28','正常推进',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-11 16:58:05','1','2018-09-20 16:23:47',NULL,'0');
INSERT INTO `aams_project` VALUES ('cbbeeba7fb9642279496d8018c217f82','2','20181220424','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;城投集团十周年庆典，置地板块开展相关活动。&lt;/span&gt;&lt;/p&gt;','集团工会','7a04dbedd53b485c96e38d283798ddc2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;1.军民共建暨城投集团十周年党建拓展活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2.红色经典主题歌会暨诗词朗诵会。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;3.置地工会全员健身运动会。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;4.棋牌友谊会。&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'','2018-12-20','',NULL,'4','1','2018-12-20 15:50:23','1','2018-12-20 16:41:54',NULL,'0');
INSERT INTO `aams_project` VALUES ('cbd2140c64464c58abc87ef1dacf86ac','3','20180124277','2','&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 仿宋; font-size: 16pt; mso-bidi-font-size: 11.0pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;2017&lt;/span&gt;年全员量化考核&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	（公司督办）&lt;/p&gt;','公司需求','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	&lt;span style=&quot;font-family: 仿宋; font-size: 21px&quot;&gt;结合集团考核实施的意见与结果，适时开展定性考核，汇总公司量化考核结果，于春节前完成并公示、上报；及时完成奖金核算与申报、发放。&lt;/span&gt;&lt;/p&gt;','2018-02-16','正常推进',NULL,NULL,'','2018-02-23','|/aams/userfiles/2/files/project/aamsProject/2018/01/2018%E5%B9%B4%E5%B7%A5%E4%BD%9C%E8%AE%A1%E5%88%92%E7%BB%BC%E5%90%88%E9%83%A8.docx',NULL,'4','2','2018-01-24 12:44:35','2','2018-02-23 14:59:21',NULL,'0');
