INSERT INTO `aams_project` VALUES ('db758d1dfc1d470ea0db68fc49952db3','2','20180228320','2','&lt;p&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size: 20px;&quot;&gt;筹备召开组织生活会，共4个阶段，6项工作&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;','公司督办','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 28px;&quot;&gt;3月31日前完成筹备并召开组织生活会，共4个阶段，6项工作&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; mso-char-indent-count: 2.0000;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 28px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;三月上旬，组织召开一次集中学习&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;，采取领学宣讲、党课辅导、交流讨论等方式，组织党员集中深入学习习近平新时代中国特色社会主义思想和党章。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 16pt; mso-spacerun: &amp;quot;yes&amp;quot;; mso-bidi-font-family: &amp;quot;Times New Roman&amp;quot;; mso-font-kerning: 1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 26pt; text-indent: 32pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 28px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;2.集中学习后，三月十八号前拿出&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;五天的时间组织公司全员开展谈心谈话&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;。书记要带头谈、带头听取意见，同时接受党员、干部约谈，根据约谈内容，做好谈话记录，汇总问题整改清单和整改方向。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 16pt; mso-spacerun: &amp;quot;yes&amp;quot;; mso-bidi-font-family: &amp;quot;Times New Roman&amp;quot;; mso-font-kerning: 1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 26pt; text-indent: 32pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 28px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;3.三月二十二号前后，组织召开民主生活会，提前十天向集团党委报备，通过会议研究提出整改措施。在组织生活会后，组织召开党员大会开展民主评议，采取民主测评的方式，准备测评用票和投票箱，根据评议结果，形成材料，上报集团党群部。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 16pt; mso-spacerun: &amp;quot;yes&amp;quot;; mso-bidi-font-family: &amp;quot;Times New Roman&amp;quot;; mso-font-kerning: 1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 26pt; text-indent: 32pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 28px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;4.三月底前，拿出过硬措施抓整改。将&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;整改事项、整改承诺及民主评议党员结果上报集团党委进行备案&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋;&quot;&gt;在九月底之前，汇总党员群众通报班子整改情况，接受党员群众监督。党员每季度要在党员大会或党小组会上报告兑现承诺情况。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋; font-size: 16pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','2018-09-30','正常推进',NULL,NULL,'','2018-10-18','|/aams/userfiles/2/files/project/aamsProject/2018/03/%E7%BD%AE%E5%9C%B0%E5%85%AC%E5%8F%B8%E6%B0%91%E4%B8%BB%E7%94%9F%E6%B4%BB%E4%BC%9A%E6%96%B9%E6%A1%88(1).docx|/aams/userfiles/2/files/project/aamsProject/2018/03/%E9%9D%92%E5%9F%8E%E6%8A%95%E5%85%9A%E5%AD%97%E3%80%942018%E3%80%952%E5%8F%B7(1).doc',NULL,'4','2','2018-02-28 11:36:40','1','2018-10-18 15:49:36',NULL,'0');
INSERT INTO `aams_project` VALUES ('db93c0dc8f0f48d7ad6b8387f2d8a0ef','3','20171227252','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;协助湿地项目工作组办理专家评审费支付&lt;/span&gt;&lt;/p&gt;','财务部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;根据集团决议，找马总签字确认金额，调整预算额度，保证专家评审费正常支付。&lt;/span&gt;&lt;/p&gt;','2017-12-29','金额经马总签字确认，调整完预算额度，支付专家费，下月报送专家费个人所得税。',NULL,NULL,'','2017-12-28','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2017-12-27 16:56:33','2','2017-12-28 11:43:44',NULL,'0');
