INSERT INTO `aams_project` VALUES ('dee6a26f75584dbd9e17506de1e4c6ff','3','20180124274','2','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;margin-left: 0cm; text-indent: 0cm;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;交通设施工程：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;margin-left: 0cm; text-indent: 28pt;&quot;&gt;\r\n	&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:14.0pt;font-family:宋体;mso-bidi-font-family:宋体&quot;&gt;1、&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:14.0pt;\r\nfont-family:宋体;mso-bidi-font-family:仿宋_GB2312&quot;&gt;工程现状：交通设施一标段实体基本完成，主要因道路路名没有确定，道路指示牌无法施工。二标段将进行公开招标。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;margin-left: 0cm; text-indent: 0cm;&quot;&gt;\r\n	&amp;nbsp;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;1）2018年2月28日完成工程招标。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;2）2018年5月30日完成施工。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;3）2018年8月30日完成工程移交。&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;','2018-08-30','正常推进',NULL,NULL,'','2018-03-29','|/aams/userfiles/2/files/project/aamsProject/2018/01/%E5%B7%A5%E7%A8%8B%E9%83%A82018%E5%B9%B4%E8%BF%9B%E5%BA%A6%E8%AE%A1%E5%88%92%E6%B1%87%E6%80%BB%E5%B7%A5%E4%BD%9C%E8%A1%A8.xls|/aams/userfile