INSERT INTO `aams_project` VALUES ('e047bd91f637499b9441ba5450f71a25','3','20171220248','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:18px;&quot;&gt;与太行园林结算代垫水电费，并收回代垫款项139257.8元&lt;/span&gt;&lt;/p&gt;','财务部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;及时与太行园林相关人员联系，结算代垫款项，双方确认后催收该款项。&lt;/span&gt;&lt;/p&gt;','2017-12-31','与太行园林相关人员确认金额，并交接确认单。',NULL,NULL,'','2017-12-28','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2017-12-20 10:35:26','2','2017-12-28 11:44:38',NULL,'0');
INSERT INTO `aams_project` VALUES ('e04a0517884f4165a70534dab101065d','3','20180620379','2','&lt;p&gt;\r\n	配合集团发债，按集团及券商、银行要求，准备相关资料，并随时配合解释其券商、银行内核、协会及交易所可能提出的新问题&lt;/p&gt;','集团资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	按集团要求及时报送相关资料。&lt;/p&gt;','2018-06-30','目前一按集团要求报送了置地、湿地、胜通公司相关资料',NULL,NULL,'','2018-07-19','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2018-06-20 08:51:51','1','2018-07-19 11:47:23',NULL,'0');
INSERT INTO `aams_project` VALUES ('e1e8153be88d45a59d872355385fba5c','1','20180613376','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;即墨宋化泉水库项目。&lt;/span&gt;&lt;/p&gt;','集团督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:30.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	8月完成与中国成套设备进出口集团有限公司（以下简称中成集团）合作备忘录的编制，同时确定备忘录的签订形式（包括时间及地点等）。&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:30.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	9月待双方审核通过合作备忘录后，推进城投集团、中成集团、即墨区政府三方合作框架协议的编制与签订工作，同步推进项目具体合作协议编制。&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:30.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span style=&quot;text-indent: 32pt;&quot;&gt;10月-11月待三方具体合作协议签订后，举行项目奠基仪式。&lt;/span&gt;&lt;/p&gt;','2018-11-30','该项目与中国成套设备进出口集团有限公司（以下简称中成集团）合作，由中成集团主导。原计划由即墨区人民政府负责将宋化泉水库资产划归至青岛城投集团，并在合作框架协议中明确。2018年9月，即墨区政府提出无法将宋化泉水库划给青岛城投集团，三方无法就资产归属未达成一致，宋化泉水库作为项目一期启动点，资产归属问题将极大影响项目整体开发模式，在确定水库资产归属方之前，暂时无法签订三方合作框架协议，项目推进暂缓，已调整为跟踪督办。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-06-13 15:44:05','1','2018-12-29 09:02:18',NULL,'0');
INSERT INTO `aams_project` VALUES ('e1f7aed374eb4e19b7c61e9bee053f53','3','20171102121','2','&lt;p&gt;\r\n	&amp;nbsp;汇报湿地公司财务情况&lt;/p&gt;','公司办公会','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&amp;nbsp;办公会上汇报湿地公司财务情况&lt;/p&gt;','2017-10-18','已完成',NULL,NULL,'','2017-11-14','',NULL,'4','a7e715befb904ea48ae3c772642a78a9','2017-11-02 08:55:55','1','2017-11-14 18:33:52',NULL,'0');
INSERT INTO `aams_project` VALUES ('e25d6f7d4c004d95acccfefa3c97814d','3','20171110170','2','&lt;p&gt;\r\n	胜通土地的价格方案。&lt;/p&gt;','部门计划','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	11月17日前完成编制并在办公会上汇报。&lt;/p&gt;','2017-11-17','编制中',NULL,NULL,'','2017-11-23','',NULL,'4','2','2017-11-10 16:05:52','2','2017-11-23 15:03:06',NULL,'0');
INSERT INTO `aams_project` VALUES ('e3fe76a41d114dc9bd13f6bfe6a79758','3','2017110197','2','&lt;p&gt;\r\n	每星期按集团资金部要求提报周资金头寸，每月末提报月末资金头寸、月资金差异表。&lt;/p&gt;','集团资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	按要求每周五下班前准时提报周头寸，月末提报月末资金头寸、月资金差异表。&lt;/p&gt;','2017-10-20','按时完成',NULL,NULL,'','2017-11-14','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2017-11-01 16:38:29','1','2017-11-14 18:34:07',NULL,'0');
INSERT INTO `aams_project` VALUES ('e44bd5d83d614a439a1904f3653101ce','1','20171114184','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;欢乐滨海城土地收储多付补偿款扣减冲抵。（挂牌督办）&lt;/span&gt;&lt;/p&gt;','集团半年业绩分析会暨部门督办调度会议督办事项（20160713）\r\n集团上半年督办调度会（20170727','4ca607d0cd50428083776ecbb4bd4c05','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;胜通公司召开股东会后，根据股东会决议及集团指示，1个月内落实审计提出问题的实施路径报告。该方案报集团审批通过后，6个月内按集团意见完成审计整改工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;1.编制审计问题整改方案；&lt;br /&gt;\r\n	2.按照解决方案制定具体的实施路径；&lt;br /&gt;\r\n	3.按照既定的方案、路径与相关单位进行谈判并及时向集团汇报。&lt;/span&gt;&lt;/p&gt;','2018-12-31','目前正在拟定其他解决方案，与集团相关领导进行沟通可行性。',NULL,NULL,'股东会决策同意后一个月内签订协议。',NULL,'',NULL,'3','1','2017-11-14 18:05:51','1','2018-05-31 13:17:49',NULL,'1');
INSERT INTO `aams_project` VALUES ('e4e8ef5968264f85825fa4aeff4990c2','3','20180228328','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;集团监事会开展2017年度监督检查工作，需提报置地公司自查报告，准备相关资料备查.&lt;/span&gt;&lt;/p&gt;','集团监事会','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	按时间节点要求准备自查报告，相关资料&lt;/p&gt;','2018-03-30','按要求提报自查报告',NULL,NULL,'','2018-03-29','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2018-02-28 17:22:24','2','2018-03-29 11:11:17',NULL,'0');
INSERT INTO `aams_project` VALUES ('e56a093fa3224357ac91fe4224994c0b','2','20180730399','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司2017年管控整改核查事项：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;资产管控：1、资产管控对接人员不明确，业务不熟悉。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;2、资产管控档案目录不清晰，影响查阅工作效率。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;3、对胜通海岸、绿洲湿地两家置地所属委托管理公司的资产管控不明确。&lt;/span&gt;&lt;/p&gt;','公司督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;7月27日完成整改并迎接集团管控检查。&lt;/span&gt;&lt;/p&gt;','2018-07-27','已完成',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-30 10:38:48','1','2018-09-20 15:46:40',NULL,'0');
INSERT INTO `aams_project` VALUES ('e57665977d314a7683ba4c733365206e','3','20180104261','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;即墨北安新型城镇化建设PPP项目咨询机构选聘，协助即墨区完成咨询机构的聘用。&lt;/span&gt;&lt;/p&gt;','置地','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;18日前与即墨区政府沟通确定咨询机构的路径；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;月底前完成咨询机构的聘用。&lt;/span&gt;&lt;/p&gt;','2018-01-31','正在与北安街道办事处对接确定咨询机构的路径。',NULL,NULL,'','2018-01-26','',NULL,'4','48433cda981346578a4515c15d5d5800','2018-01-04 15:28:29','2','2018-01-26 16:46:03',NULL,'0');
INSERT INTO `aams_project` VALUES ('e66decd1642745f4a8b60e1ec8e6c744','1','2017110134','2','&lt;p&gt;\r\n	跟踪审计结果，协调相关部门争取资金平衡&lt;/p&gt;','集团半年业绩分析会暨部门督办调度会议督办事项（20160713）','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	1.集团明确收储意见后，在完成土地收储手续办理后，6个月内完成施工，并进行竣工验收工作； 2.项目竣工验收结束后，申请项目工程审计。 3.待工程审计完成并取得审计报告后，6个月内完善资金方案分析报告，并按照市政府会议纪要【2012】第42号要求，完成资金缺口测算及资金平衡措施，上报市政府进行审议。&lt;/p&gt;','2017-12-31','待审计整改落实后，根据情况落实资金平衡问题。',NULL,NULL,'工程审计完成后3个月内提报资金缺口测算及资金平衡方',NULL,'',NULL,'3','2','2017-11-01 09:57:44','2','2017-11-01 09:57:44',NULL,'1');
INSERT INTO `aams_project` VALUES ('e7718fc196cf4a3fa9a4ecfd310e1b5c','3','20180228326','2','&lt;p&gt;\r\n	报二月份安全月报&lt;/p&gt;','公司督办','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	2月28日前完成提报2月份安全月报&lt;/p&gt;','2018-02-28','已完成',NULL,NULL,'','2018-03-01','',NULL,'4','2','2018-02-28 14:20:33','2','2018-03-01 11:35:37',NULL,'0');
INSERT INTO `aams_project` VALUES ('e7d7c12ba6ce4df99ad9df4a65be9fa1','3','20180124272','2','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;排水工程：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;、工程现状：排水工程实体已基本完成。一标段已办理正式移交工作。&lt;span lang=&quot;EN-US&quot;&gt;A&lt;/span&gt;区横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;排水工区进行初验收。二标段因学校破坏段无法进行初验收。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;、存在问题：二标段横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;路因学校破坏，无法进行验收移交工作。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;工作计划：&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;~11&lt;/span&gt;月，&lt;span lang=&quot;EN-US&quot;&gt;A&lt;/span&gt;区横&lt;span lang=&quot;EN-US&quot;&gt;A3&lt;/span&gt;路排水移交完成。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-bidi-font-family: 仿宋_GB2312;&quot;&gt;）&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;~12&lt;/span&gt;月，二标段排水工程移交完成。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'',NULL,'|/aams/userfiles/2/files/project/aamsProject/2018/01/%E5%B7%A5%E7%A8%8B%E9%83%A82018%E5%B9%B4%E8%BF%9B%E5%BA%A6%E8%AE%A1%E5%88%92%E6%B1%87%E6%80%BB%E5%B7%A5%E4%BD%9C%E8%A1%A8.xls|/aams/userfiles/2/files/project/aamsProject/2018/01/%E6%AC%A2%E4%B9%90%E6%BB%A8%E6%B5%B7%E5%9F%8E%E5%B8%82%E6%94%BF%E9%85%8D%E5%A5%972018%E5%B9%B4%E5%B7%A5%E7%A8%8B%E8%AE%A1%E5%88%92.doc',NULL,'5','2','2018-01-24 12:35:19','1','2018-06-07 17:06:45',NULL,'0');
INSERT INTO `aams_project` VALUES ('e8256816ff104541ba1f98ba588bd671','3','2017110148','2','&lt;p&gt;\r\n	完成孙立同志、吕风梅同志内部调动相关手续、社保、公积金、补贴、福利等的办理工作。完成离职员工程小沁的工资、停保、公积金等各项手续办理工作。&lt;/p&gt;','公司办公会督办事项','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	10月18日下发工资前全部完成&lt;/p&gt;','2017-10-18','已完成',NULL,NULL,'','2017-11-14','',NULL,'4','e6f82d6e4d134a42bd16ff82212da226','2017-11-01 14:40:31','1','2017-11-14 18:34:16',NULL,'0');
INSERT INTO `aams_project` VALUES ('ea1931d66b8c44a4afb42049d5e24e5a','3','20171102136','2','&lt;p&gt;\r\n	剩余道路工程造价专家评审通过&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	11月2日工程造价提交集团部门审批&lt;/p&gt;\r\n&lt;p&gt;\r\n	11月10日前组织专家评审&lt;/p&gt;\r\n&lt;p&gt;\r\n	11月17日完成修改后的工程造价&lt;/p&gt;','2017-11-17','1、工程造价编制完成并提报集团部门',NULL,NULL,'','2017-11-23','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 09:26:41','2','2017-11-23 15:06:56',NULL,'0');
INSERT INTO `aams_project` VALUES ('ecb3dd88a8f64859890ce5bb69333080','2','20180925414','2','&lt;p&gt;\r\n	制定置地公司2018年公车改革方案&lt;/p&gt;','集团纪检监察室','7a04dbedd53b485c96e38d283798ddc2','&lt;p&gt;\r\n	于9月25日之前完成置地公司2018年公车改革方案&lt;/p&gt;','2018-09-25','已完成',NULL,NULL,'','2018-10-18','|/aams/userfiles/1/files/project/aamsProject/2018/09/20180921%E7%BD%AE%E5%9C%B0%E5%85%AC%E5%8F%B8%E5%85%AC%E8%BD%A6%E6%94%B9%E9%9D%A9%E6%96%B9%E6%A1%88%E5%8F%8A%E9%99%84%E8%A1%A8.docx',NULL,'4','1','2018-09-25 14:36:23','1','2018-10-18 15:50:42',NULL,'0');
INSERT INTO `aams_project` VALUES ('ecf7f472f63b419e8beba51b7aeb92e6','1','20171114187','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px&quot;&gt;欢乐滨海城综合盈亏情况测算（调整）&lt;/span&gt;&lt;/p&gt;','集团上半年督办调度会（20170727）','4ca607d0cd50428083776ecbb4bd4c05','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px&quot;&gt;推动审计整改方案落实，待剩余土地收储及工程竣工审计后一个月内完成&lt;/span&gt;&lt;/p&gt;','2017-12-31','12月25日已发函至国土局，申请对剩余土地补偿进行重新评估。以欢乐滨海城项目土地审计为前置条件，待审计问题解决后，才能进行剩余土地收储和工程审计。目前，土地审计问题正在推进中，工程审计的材料在工程投资过程中均已准备完成，综合盈亏测算方案需要待工程审计结束后方能出具报告。\r\n正常推进',NULL,NULL,'工程审计完成后1个月内完成',NULL,'',NULL,'3','1','2017-11-14 18:09:29','2','2018-03-28 15:26:11',NULL,'1');
INSERT INTO `aams_project` VALUES ('ed2f982507ee4405a6de64222845bed9','3','2017110172','2','&lt;p&gt;\r\n	订阅2018年度半岛都市报两份，并完成报销流程&lt;/p&gt;','集团交办事项','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	10月31日前订阅2018年度半岛都市报两份，并完成报销流程&lt;/p&gt;','2017-10-31','已办结',NULL,NULL,'','2017-11-14','',NULL,'4','28d2adbfc20a40a79fd7f8c8393820df','2017-11-01 15:43:18','1','2017-11-14 18:34:25',NULL,'0');
INSERT INTO `aams_project` VALUES ('ef20191117704d138beb863daec24aae','3','20180905412','2','&lt;p&gt;\r\n	审计署检查地方隐性债务，按集团要求配合检查并报送相关资料&lt;/p&gt;','集团资金部','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	按资金部要求首先及时报送相关资料&lt;/p&gt;','2018-09-30','已按资金部要求于2018年9月5日先行报送所需检查资料',NULL,NULL,'','2018-09-20','',NULL,'4','add6f72a55a74829b75ce9da0fd9726b','2018-09-05 14:06:10','1','2018-09-20 16:47:12',NULL,'0');
INSERT INTO `aams_project` VALUES ('efe943d2720a4b27a79740205d000dae','3','20171218244','2','&lt;p&gt;\r\n	发布集团与葛洲坝集团签订战略合作协议，集团与即墨区政府、葛洲坝集团签订三方框架协议的简讯&lt;/p&gt;','置地','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	协议签订后，收集相关影像资料，编辑简讯于集团内网发布。&lt;/p&gt;','2017-12-21','已完成。',NULL,NULL,'','2017-12-21','|/aams/userfiles/48433cda981346578a4515c15d5d5800/files/project/aamsProject/2017/12/%E4%B8%8E%E5%8D%B3%E5%A2%A8%E4%B8%89%E6%96%B9%E6%A1%86%E6%9E%B6%E5%8D%8F%E8%AE%AE%E7%AD%BE%E8%AE%A2%E7%9A%84%E7%AE%80%E8%AE%AF.png|/aams/userfiles/48433cda981346578a4515c15d5d5800/files/project/aamsProject/2017/12/%E4%B8%8E%E8%91%9B%E6%B4%B2%E5%9D%9D%E7%AD%BE%E8%AE%A2%E6%88%98%E7%95%A5%E5%8D%8F%E8%AE%AE%E7%9A%84%E7%AE%80%E8%AE%AF.png',NULL,'4','48433cda981346578a4515c15d5d5800','2017-12-18 09:09:39','2','2017-12-21 11:04:04',NULL,'0');
INSERT INTO `aams_project` VALUES ('f1283ff6b9a845788ed623cfaa3a5058','2','20180124280','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:黑体;\r\nmso-hansi-font-family:黑体;mso-bidi-font-family:仿宋_GB2312;mso-ansi-language:EN-US;\r\nmso-fareast-language:ZH-CN;mso-bidi-language:AR-SA;mso-bidi-font-weight:bold&quot;&gt;欢乐滨海城土地项目&lt;/span&gt;&lt;span style=&quot;font-family: 楷体; font-size: 16pt; text-indent: 32pt;&quot;&gt;审计遗留问题&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;审计遗留问题解决的前提下，开展招商项目落地及土地挂牌出让工作。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: 楷体; font-size: 21.3333px; text-indent: 42.6667px;&quot;&gt;招商及土地挂牌出让&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;因该项目的总体招商要结合市北区的产业布局进行，在研究新项目的同时，首先考虑市北区政府引进企业落地的可能性，然后根据置地公司研究项目的方向，适时引荐企业到欢乐滨海城项目考察，具备条件的情况下，进行合作协议签署、土地挂牌等事宜。&lt;/span&gt;&lt;span style=&quot;font-family: 仿宋_GB2312; font-size: 16pt; text-indent: 32pt;&quot;&gt;审计遗留问题解决的前提下，配合公司及其他部门开展资金平衡测算，寻找资金平衡的路径。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size: 16pt; font-family: 楷体;&quot;&gt;资金平衡事宜&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;审计遗留问题解决的前提下，配合公司及其他部门开展资金平衡测算，寻找资金平衡的路径。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:楷体;mso-bidi-font-family:仿宋_GB2312;\r\nmso-bidi-font-weight:bold&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:楷体;mso-bidi-font-family:仿宋_GB2312;\r\nmso-bidi-font-weight:bold&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','集团督办','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、按照实施方案向青岛市政府或国土局请示，重新评估欢乐滨海城项目剩余土地补偿价格，&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月份，协调国土局办公室公文流转及领导批转主办单位，按照国土局领导批转主办单位，每周两次跟踪办理情况。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月份，跟踪土地储备中心具体承办意见，同步跟进国土局市场处对欢乐城剩余土地重新进行补偿评估的办理意见。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、&lt;span lang=&quot;EN-US&quot;&gt;2018&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;月份，跟踪国土局储备中心、市场处、办公室等部门对该事项的最终办理意见，同步准备重新进行评估所需的地形图、定界图、面积图，委托评估机构内部流程。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、市政府或国土局同意请示意见后，一个月内完成剩余土地补偿价格评估并报相关单位审批。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:32.0pt;mso-char-indent-count:2.0;\r\nline-height:27.0pt;mso-line-height-rule:exactly&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、补偿价格批复并经审计部门同意后，两个月内完成同胜通公司的谈判、召开胜通公司股东会、集团董事会等工作。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:\r\n仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;、上述工作完成后，两个月内完成补偿协议签订、土地证注销纳入储备工作，在补偿协议内约定，土地补偿清算统一解决之前的遗留问题。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot; style=&quot;text-indent: 32pt; line-height: 28pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;\r\nmso-bidi-font-family:仿宋_GB2312;mso-bidi-font-weight:bold&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','2018-12-31','正常推进',NULL,NULL,'',NULL,'|/aams/userfiles/2/files/project/aamsProject/2018/01/%E6%8A%95%E8%B5%84%E9%83%A82018%E5%B9%B4%E5%B7%A5%E4%BD%9C%E5%AE%89%E6%8E%92.docx',NULL,'3','2','2018-01-24 12:50:55','2','2018-01-24 12:52:27',NULL,'1');
