INSERT INTO `aams_project` VALUES ('f532c705ee4e4e08b454c41de8945901','1','20171228254','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px;&quot;&gt;藏马山项目。&lt;/span&gt;&lt;/p&gt;','重点项目专题会\r\n（20171117）','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse;&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664;&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;408&quot; style=&quot;height: 306pt; page-break-before: always;&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;408&quot; style=&quot;border-width: 0.5pt medium; border-style: solid none; border-color: windowtext; width: 695pt; height: 306pt; background-color: transparent;&quot; width=&quot;927&quot;&gt;\r\n				&lt;span style=&quot;font-size: 22px;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;鉴于藏马山项目目前切入时机不成熟，该项目保持继续与藏马山旅游度假区领导小组跟进的同时，拟先行洽谈西海岸新区其他项目，再择机介入。具体安排如下：&lt;br /&gt;\r\n				1月继续与藏马山旅游度假区领导小组办公室对接，对该项目进行详细调查，重点寻找切合投资时机的项目，每周1一次。&lt;br /&gt;\r\n				2月按照摸底情况，对接区域内具体项目的投资合作方，对项目的情况进行尽调，完成项目资料的整理。&lt;br /&gt;\r\n				3月研究项目投资合作模式，寻找投资路径，并进行论证，置地公司内部形成意见。&lt;br /&gt;\r\n				4月按照公司确定的投资模式与项目方进行谈判、论证，确定项目能否合作。&lt;br /&gt;\r\n				5月根据上述谈判的情况，具体安排上报集团内部上会审批程序。&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;','2018-06-01','经与藏马山旅游度假区领导小组办公室多次对接，拟对藏马山东侧丰泽山庄周边的土地进行整理，引进健康养老项目，2月份已收集项目的相关资料，3月份现计划与蓝卡健康成立合资公司的方式进行康养项目的合作，下一步具体考察蓝卡健康的运营项目情况。',NULL,NULL,'5月底',NULL,'',NULL,'3','2','2017-12-28 09:13:54','1','2018-05-31 13:17:20',NULL,'1');
