INSERT INTO `aams_project` VALUES ('f7aa23580fc847ca8ca758d679b70995','2','20180730397','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;置地公司2017年管控整改核查事项：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;资金管控：资金计划执行不准确。&lt;/span&gt;&lt;/p&gt;','公司督办','be8c47be63974f538e5a5ef77e0bb2b2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 24px;&quot;&gt;7月27日完成整改并迎接集团管控检查。&lt;/span&gt;&lt;/p&gt;','2018-07-27','已完成',NULL,NULL,'','2018-09-20','',NULL,'4','1','2018-07-30 10:23:47','1','2018-09-20 15:47:40',NULL,'0');
INSERT INTO `aams_project` VALUES ('f7f972d527aa481fa7b12e502f939d59','1','20171114190','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;关于市北区欢乐滨海城小区路灯不亮问题，请置地公司高度重视，落实责任，采取有效措施，尽快解决上述问题，要就手续办理、招标、开工、完工等工作制定具体时间表。&lt;/span&gt;&lt;/p&gt;','DT2017024','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;10月研究招标路径及方式，提交招标中介申请报告。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;11月完善施工图，完成招标控制价、招标文件及招标公告的编制，提请集团招标委员会审计。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;12月经招标委员会同意，进行公开招标。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;争取在2018年1月完成招标。2018年3月完成路灯安装。&lt;/span&gt;&lt;/p&gt;','2018-06-30','已与市北区滨海管委会就招标路径沟通，本月底前向集团公司相关部门提报招标代理机构中介服务申请。',NULL,NULL,'2018年二季度完成路灯工程施工和项目移交',NULL,'',NULL,'3','1','2017-11-14 18:13:45','2','2018-01-11 11:28:42',NULL,'1');
