INSERT INTO `aams_project` VALUES ('fa50d0330d0b4eae8fc452bb5b17f09d','1','20181229425','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:26px;&quot;&gt;&amp;ldquo;新材料科技中心&amp;rdquo;项目&lt;/span&gt;&lt;/p&gt;','集团办公室','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;11月完成战略会审议。 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:22px;&quot;&gt;12月完成集团董事会审议。 根据集团决议启动合资公司的注册工作。&lt;/span&gt;&lt;/p&gt;','2018-12-31','1、12月11日取得舞阳路39号地块补偿方案的书面函件。2、12月20日市北区如开滨海新区部分项目规划专题会，同意该项目商业比例按照55%进行规划方案深化设计。3、本周完成可研报告的修改并提交集团战略会。',NULL,NULL,'',NULL,'',NULL,'3','1','2018-12-29 09:04:03','1','2018-12-29 09:04:03',NULL,'0');
INSERT INTO `aams_project` VALUES ('faa29bc42dfb4e19a440c73c9d7b158a','1','2017110137','2','&lt;p&gt;\r\n	欢乐滨海城审计冲减抵顶事宜要抓紧推进，方案经胜通公司同意、集团董事会研究通过后，迅速签定协议实施。&lt;/p&gt;','集团上半年督办调度会（20170727)','ce1e8ce056374ed5a9a6b692c06aeb8d','&lt;p&gt;\r\n	8月份将审计整改方案通知胜通公司；待胜通股东认可后将提报集团董事会审议欢乐滨海城项目审计整改方案。&lt;/p&gt;','2018-11-01','8月7日已与胜通公司初步沟通，待其股东全部认可后提报集团董事会审议',NULL,NULL,'方案经胜通公司同意、集团董事会研究通过、胜通公司股东会通过后，一个月内签订协议。',NULL,'',NULL,'3','2','2017-11-01 10:36:42','2','2017-11-01 10:36:42',NULL,'1');
INSERT INTO `aams_project` VALUES ('fd0462e688314bd2a482c17077ea2afb','1','20171114182','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size: 20px&quot;&gt;双子塔协议签订。&lt;/span&gt;&lt;/p&gt;','重点工作','4ca607d0cd50428083776ecbb4bd4c05','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;width: 695pt; border-collapse: collapse&quot; width=&quot;927&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col style=&quot;width: 695pt; mso-width-source: userset; mso-width-alt: 29664&quot; width=&quot;927&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;207&quot; style=&quot;height: 155.25pt; mso-height-source: userset&quot;&gt;\r\n			&lt;td class=&quot;xl69&quot; height=&quot;207&quot; style=&quot;border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: transparent; width: 695pt; height: 155.25pt; border-top: windowtext 0.5pt solid; border-right: windowtext&quot; width=&quot;927&quot;&gt;\r\n				&lt;span style=&quot;font-size: 24px&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;已办理延期，待项目建设方案确定并实现产业税收后再根据相关会议纪要要求研究协议的签订事宜。&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;','2018-12-31','暂无进展',NULL,NULL,'至项目建设方案确定并实现产业税收后再根据相关会议纪要要求研究协议的签订事宜。',NULL,'',NULL,'3','1','2017-11-14 17:30:02','2','2018-03-29 11:02:11',NULL,'1');
INSERT INTO `aams_project` VALUES ('fd3be3e9ee7f4f469b1da168ce1bdfb2','3','20180308332','2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;组织全体员工召开安全生产会&lt;/span&gt;&lt;/p&gt;','集团安全生产部要求','66ad875799dd4edeb2f648eb9486e9e2','&lt;p&gt;\r\n	&lt;span style=&quot;font-size:20px;&quot;&gt;3月9日组织全员召开安全生产会&lt;/span&gt;&lt;/p&gt;','2018-03-09','正常推进',NULL,NULL,'建议参见人员加2分','2018-03-20','|/aams/userfiles/2/files/project/aamsProject/2018/03/%E5%BE%AE%E4%BF%A1%E5%9B%BE%E7%89%87_20180320104426.jpg',NULL,'4','2','2018-03-08 12:07:38','2','2018-03-20 10:46:15',NULL,'0');
INSERT INTO `aams_project` VALUES ('fd5134b6227b47ddb45c8348420871c3','3','20171102135','2','&lt;p&gt;\r\n	协调市北城管局对道路、绿化移交的相关费用情况来函。&lt;/p&gt;','集团督办','19b99420a1f944dbbb37f2c53f57ce41','&lt;p&gt;\r\n	11月15日协调市北城管局对道路、绿化移交过程中的费用来函。&lt;/p&gt;','2017-11-15','1、移交工作协调会于10月28日开。\r\n2、按会议要求分别与道路、绿化接收单位对相关费用进行深入沟通，基本达成一致。',NULL,NULL,'','2017-11-23','',NULL,'4','74e79e41898647b8bca0bafd689472ec','2017-11-02 09:20:30','2','2017-11-23 14:42:42',NULL,'0');
